	(1, 2, 2, 3, '2022-04-20', '2022-04-01', '2022-04-30', 99999.00, 1, 'a:3:{i:0;s:2:"46";i:1;s:2:"38";i:2;s:2:"36";}', '', '<p style="text-align: center;"><span style="font-family: arial, helvetica, sans-serif;"><strong>CONTRATO DE SERVICIO ALQUILER DE SISTEMA CONTABLE SIIA</strong></span></p>\n<p style="text-align: center;">&nbsp;</p>\n<p style="text-align: left;"><span style="font-family: arial, helvetica, sans-serif;">Conste por el presente documento, el Contrato de Alquiler del Sistema Contable SIIA que celebran:</span></p>', '<p><span style="font-family: arial, helvetica, sans-serif;"><strong>A. LA EMPRESA:</strong></span></p>\n<p style="padding-left: 40px;"><span style="font-family: arial, helvetica, sans-serif;">NOMBRE&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; : <strong>ACG SOFT S.A.C.</strong></span><br /><span style="font-family: arial, helvetica, sans-serif;">N&Uacute;MERO DE RUC&nbsp; &nbsp;: 20601830931</span><br /><span style="font-family: arial, helvetica, sans-serif;">DOMICILIO&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;: Calle Chinch&oacute;n N&deg; 409 &ndash; Urb. Jard&iacute;n &ndash; San Isidro&nbsp;</span><br /><span style="font-family: arial, helvetica, sans-serif;">REPRESENTANTE&nbsp; &nbsp;: GERENTE GENERAL</span><br /><span style="font-family: arial, helvetica, sans-serif;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Sandra Isabel Cucho G&oacute;ngora</span><br /><span style="font-family: arial, helvetica, sans-serif;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; DNI. N&ordm; 74291478</span></p>\n<p><strong><span style="font-family: arial, helvetica, sans-serif;">B. EL CLIENTE:</span></strong></p>\n<p style="padding-left: 40px;"><span style="font-family: arial, helvetica, sans-serif;">NOMBRE&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;: <strong>GESTOR DE SOLUCIONES EMPRESARIALES S.A.C</strong></span><br /><span style="font-family: arial, helvetica, sans-serif;">NUMERO DE RUC&nbsp; : 20605122729</span><br /><span style="font-family: arial, helvetica, sans-serif;">DOMICILIO&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; : Calle Talladores N&ordm; 183 Dpto. Ps 1 &ndash; Urb. Artesanos &ndash; Ate - Lima</span><br /><span style="font-family: arial, helvetica, sans-serif;">REPRESENTANTE : GERENTE GENERAL</span><br /><span style="font-family: arial, helvetica, sans-serif;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Andrea Luc&iacute;a Benavides Gil</span><br /><span style="font-family: arial, helvetica, sans-serif;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; DNI. N&ordm; 45394164</span></p>', '<p>&nbsp;</p>\n<p><span style="font-family: arial, helvetica, sans-serif;">Bajo los t&eacute;rminos y condiciones contractuales siguientes:</span></p>\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;"><strong>CL&Aacute;USULA PRIMERA.</strong> - <strong>LAS PARTES Y ANTECEDENTES</strong>&nbsp;&nbsp;</span></p>\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">1.1 LA EMPRESA es una sociedad an&oacute;nima cerrada, debidamente constituida, que desarrolla actividades referidas a los servicios inform&aacute;ticos especializados en mantenimiento y soporte de Software, adem&aacute;s de brindar consultor&iacute;a de gesti&oacute;n de procesos en diversos rubros empresariales.&nbsp;</span></p>\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">1.2 EL CLIENTE es una persona jur&iacute;dica de derecho privado cuya actividad principal es <strong><u>elaborar bebidas no alcoh&oacute;licas, producci&oacute;n de agua mineral y otras aguas embotelladas. </u></strong></span></p>\n<p style="text-align: justify;">&nbsp;</p>\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;"><strong>CL&Aacute;USULA SEGUNDA. - OBJETO DEL CONTRATO </strong>&nbsp;</span></p>\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">Por el presente contrato, LA EMPRESA, se obliga a ceder en uso, no exclusiva, a <strong>EL CLIENTE</strong>, del Sistema&nbsp; (SIIA) Back Office, conforme lo detallado en el &ldquo;Anexo 1&rdquo;, que forma parte integrante del presente instrumento.</span></p>\n<p style="text-align: justify;">&nbsp;</p>\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;"><strong>CL&Aacute;USULA TERCERA. &ndash; OBLIGACIONES DE LA EMPRESA&nbsp;&nbsp; </strong></span></p>\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">LA EMPRESA se obliga a cumplir con lo siguiente:</span></p>\n<ol style="text-align: justify;">\n<li><span style="font-family: arial, helvetica, sans-serif;"><strong> </strong>LA EMPRESA, se obliga a cumplir con los servicios especializados descritos en el ANEXO 1.</span></li>\n<li><span style="font-family: arial, helvetica, sans-serif;"><strong> </strong>LA EMPRESA se obliga a mantener la confidencialidad de los documentos que se manejen en la prestaci&oacute;n del servicio a EL CLIENTE.</span></li>\n<li><span style="font-family: arial, helvetica, sans-serif;"><strong> </strong>LA EMPRESA, garantiza la idoneidad del servicio prestado en virtud del presente contrato.</span></li>\n<li><span style="font-family: arial, helvetica, sans-serif;"><strong> </strong>LA EMPRESA, se obliga a cumplir con los est&aacute;ndares, pol&iacute;ticas, instrucciones y normas de seguridad que EL CLIENTE disponga respecto al acceso a sus instalaciones y cualquier otra.</span></li>\n<li><span style="font-family: arial, helvetica, sans-serif;"><strong> </strong>LA EMPRESA responder&aacute;, por los da&ntilde;os y perjuicios ocasionados a <strong>EL CLIENTE </strong>por errores o defectos causados por ella misma o el personal a su servicio en la ejecuci&oacute;n del presente contrato.</span></li>\n<li><span style="font-family: arial, helvetica, sans-serif;"><strong> </strong>Estas obligaciones son enunciativas m&aacute;s no limitativas.</span></li>\n</ol>\n<p style="text-align: justify;">&nbsp;</p>\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;"><strong>CL&Aacute;USULA CUARTA. &ndash; OBLIGACIONES DE EL CLIENTE </strong></span></p>\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">EL CLIENTE se obliga a cumplir con lo siguiente:</span></p>\n<ol style="text-align: justify;">\n<li><span style="font-family: arial, helvetica, sans-serif;"><strong>EL CLIENTE</strong>, se obliga a abonar a LA EMPRESA cumplir oportunamente con la retribuci&oacute;n pactada en la cl&aacute;usula cuarta, en caso de incumplimiento se suspender&aacute; el servicio.</span></li>\n<li><span style="font-family: arial, helvetica, sans-serif;"><strong>EL CLIENTE</strong>, se obliga a brindar todas las facilidades, el cabal cumplimiento de los servicios especializados de LA EMPRESA.</span></li>\n</ol>\n<ol style="text-align: justify;">\n<li><span style="font-family: arial, helvetica, sans-serif;">Estas obligaciones son enunciativas m&aacute;s no limitativas.</span></li>\n</ol>\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;"><strong>&nbsp;</strong></span></p>\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;"><strong>CL&Aacute;USULA CUARTA. - DE LA CONTRAPRESTACION&nbsp; </strong></span></p>\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">Las partes acuerdan que los honorarios se encuentran conformados conforme lo siguiente:</span></p>\n<ol style="text-align: justify;">\n<li><span style="font-family: arial, helvetica, sans-serif;"><strong> </strong>An&aacute;lisis, dise&ntilde;o y desarrollo de Interfaces con el sistema de gesti&oacute;n, realizando la migraci&oacute;n de datos de: ventas y tipos de pago, los honorarios ascienden a US$. XXXXXX m&aacute;s el IGV.</span></li>\n<li><span style="font-family: arial, helvetica, sans-serif;"><strong> </strong>Los honorarios por la cesi&oacute;n de uso de los sistemas SIIA son de US$. XXXXXX m&aacute;s el IGV.</span></li>\n</ol>\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;"><strong>&nbsp;</strong></span></p>\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;"><strong>FORMA DE PAGO</strong></span></p>\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">El pago por la interfaz ser&aacute; en 6 cuotas, pago por &uacute;nica vez.</span></p>\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">Por la cesi&oacute;n de uso de los sistemas SIIA el pago se realizar&aacute; los 5 primeros d&iacute;as de cada mes a partir del mes 7.</span></p>\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">Los comprobantes de pago emitidos como consecuencia de los servicios contratados, deber&aacute;n cancelarse en el mes corriente, dentro de los primeros cinco (05) d&iacute;as del mes vigente por EL CLIENTE, o a trav&eacute;s de un medio de pago v&aacute;lido, de lo contrario, el servicio quedar&aacute; suspendido autom&aacute;ticamente sin necesidad de comunicaci&oacute;n alguna por parte de LA EMPRESA.</span></p>\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;"><strong>&nbsp;</strong></span></p>\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;"><strong>CL&Aacute;USULA QUINTA. - DE LA CONFIDENCIALIDAD DE LAS PARTES Y ETICA&nbsp; </strong></span></p>\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;"><strong>LA EMPRESA,</strong> sus representantes y empleados guardar&aacute;n absoluta reserva y confidencialidad respecto de los servicios objeto del presente contrato, as&iacute; como de cualquier informaci&oacute;n relativa a los negocios u operaciones de <strong>EL CLIENTE</strong>, incluyendo, entre otros, las t&eacute;cnicas industriales, m&eacute;todos de sistemas y de todo elemento constitutivo de la propiedad industrial, resultados, documentaci&oacute;n e informaci&oacute;n de <strong>EL CLIENTE</strong> a los que pudiera tener acceso o conocimiento en virtud del presente contrato, debiendo guardar discreci&oacute;n absoluta sobre estas informaciones. Esta obligaci&oacute;n subsistir&aacute; hasta despu&eacute;s de un (01) a&ntilde;o de terminado el presente contrato.</span></p>\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;"><strong>EL CLIENTE</strong> no podr&aacute; contratar o sub contratar empleados o ex empleados Especialistas de Servicio de LA EMPRESA sin la expresa aprobaci&oacute;n de misma hasta 02 a&ntilde;os posteriores a su cese oficial<strong>. EL CLIENTE</strong> declara que en caso de contravenir la presente obligaci&oacute;n reconocer&aacute; a favor de <strong>LA EMPRESA</strong> un importe equivalente a dos (02) a&ntilde;os de la contraprestaci&oacute;n econ&oacute;mica pactada en el contrato.</span></p>\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;"><strong>&nbsp;</strong></span></p>\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;"><strong>CL&Aacute;USULA SEXTA. - DE LA DURACI&Oacute;N DEL CONTRATO&nbsp; </strong></span></p>\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">El presente contrato se suscribe por el plazo de un (01) a&ntilde;o, que empezar&aacute; a computarse a partir del 01 de enero de 2022 y terminar&aacute; el 31 de diciembre del 2022.</span></p>\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">Queda expresamente pactado que salvo en caso de comunicaci&oacute;n expresa en sentido contrario, comunicada dentro de cuarenta y cinco d&iacute;as antes del vencimiento del plazo del presente contrato, &eacute;ste quedar&aacute; autom&aacute;ticamente renovado por sucesivos periodos de igual duraci&oacute;n.</span></p>\n<p style="text-align: justify;">&nbsp;</p>\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;"><strong>CL&Aacute;USULA SEPTIMA.- RESOLUCI&Oacute;N </strong>&nbsp;</span><span style="font-family: arial, helvetica, sans-serif;"><strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</strong></span></p>\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;"><strong>EL CLIENTE</strong>, podr&aacute; resolver el presente Contrato ante el cumplimiento parcial, tard&iacute;o o defectuoso o el incumplimiento por parte de <strong>LA EMPRESA</strong> de cualquiera de las obligaciones establecidas en el presente documento y sus anexos, para lo cual <strong>EL CLIENTE</strong> deber&aacute; comunicar por escrito su decisi&oacute;n de resolver, recibida dicha comunicaci&oacute;n por la otra parte, el Contrato se entender&aacute; resuelto.</span></p>\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">Las partes acuerdan que, el presente contrato puede ser resuelto por decisi&oacute;n unilateral de cualquiera de las partes, para lo cual la parte que desee resolver el presente contrato deber&aacute; notificar a la otra con una antelaci&oacute;n de cuarenta y cinco (45) d&iacute;as calendario. La presente resoluci&oacute;n no acarreara penalidad alguna.&nbsp;</span></p>\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">&nbsp;<strong>&nbsp;</strong>&nbsp;</span></p>\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;"><strong>CL&Aacute;USULA OCTAVA.- INTERPRETACION, JURISDICCION Y COMPETENCIA </strong>&nbsp;&nbsp;</span></p>\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">La interpretaci&oacute;n del presente contrato, se ajustar&aacute; al texto del mismo y, en su defecto, al C&oacute;digo Civil y a los principios generales del derecho.&nbsp;</span></p>\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">Las partes acuerdan de forma expresa que cualquier controversia o diferencia con relaci&oacute;n a la existencia, validez, cumplimiento o ejecuci&oacute;n del presente contrato ser&aacute; resuelta por un &aacute;rbitro &uacute;nico nombrado por la C&aacute;mara Peruana de Arbitraje Mercantil, instituci&oacute;n a la cual las partes confieren el encargo de designaci&oacute;n conforme al inciso 3&ordm; del art&iacute;culo 22&ordm; del Decreto Legislativo N&ordm; 1071. Para tal prop&oacute;sito, las partes acuerdan y aceptan que el citado &aacute;rbitro sustanciara el proceso como un arbitraje de derecho y conforme a las reglas que considere m&aacute;s apropiadas de acuerdo a las circunstancias del caso y teniendo en cuenta el Decreto Legislativo N&ordm; 1071. Y por ende los intervinientes se&ntilde;alan como sus domicilios los consignados en la introducci&oacute;n del presente documento, a donde se les tendr&aacute; por notificados en forma v&aacute;lida.</span></p>\n<p style="text-align: justify;">&nbsp;</p>\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;"><strong>CL&Aacute;USULA NOVENA. -&nbsp; ACEPTACI&Oacute;N </strong>&nbsp;</span></p>\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">Las partes, aceptan todas y cada una de las cl&aacute;usulas establecidas en el presente contrato y se obligan a su fiel cumplimiento, en se&ntilde;al de conformidad firman el 28 de diciembre del 2021</span></p>', '<p style="text-align: center;"><span style="font-family: arial, helvetica, sans-serif;"><strong><u>ANEXO N&deg; 1</u></strong></span></p>\n<p style="text-align: justify;">&nbsp;</p>\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">Las partes acuerdan que el presente Anexo 1, establece el alcance del servicio materia de contrataci&oacute;n:</span></p>\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">El servicio materia de contrataci&oacute;n consiste en integrar la informaci&oacute;n contable en una sola base de datos la misma que es generada por los usuarios mediante un sistema de gesti&oacute;n con la finalidad de integrar y brindar informaci&oacute;n, partiendo de un principio, que la informaci&oacute;n se ingresa al sistema una sola vez, nuestro servicio se concentra en la validaci&oacute;n de la informaci&oacute;n en SIIA&nbsp; gesti&oacute;n de control y formulaci&oacute;n de reportes.</span></p>\n<p style="text-align: justify;">&nbsp;</p>\n<p><span style="font-family: arial, helvetica, sans-serif;"><strong>&nbsp; &nbsp; &nbsp;I. INTERFACE E IMPLEMENTACI&Oacute;N DE SISTEMAS</strong></span></p>\n<p style="padding-left: 40px;"><span style="font-family: arial, helvetica, sans-serif;"><strong>1. </strong><strong>Implementaci&oacute;n de sistemas </strong></span></p>\n<p style="padding-left: 80px;"><span style="font-family: arial, helvetica, sans-serif;"><strong>a. <u>Contabilidad</u></strong></span></p>\n<ul>\n<li style="list-style-type: none;">\n<ul>\n<li style="list-style-type: none;">\n<ul style="text-align: justify;">\n<li><span style="font-family: arial, helvetica, sans-serif;">Multiempresa</span></li>\n<li><span style="font-family: arial, helvetica, sans-serif;">Multiusuario</span></li>\n<li><span style="font-family: arial, helvetica, sans-serif;">Nivel de perfil de seguridad</span></li>\n<li><span style="font-family: arial, helvetica, sans-serif;">An&aacute;lisis de gastos por centro de costo</span></li>\n<li><span style="font-family: arial, helvetica, sans-serif;">Emisi&oacute;n de reportes anal&iacute;ticos</span></li>\n<li><span style="font-family: arial, helvetica, sans-serif;">Emisi&oacute;n de reporte de estados financieros</span></li>\n<li><span style="font-family: arial, helvetica, sans-serif;">Emisi&oacute;n de reportes para declaraci&oacute;n a SUNAT (PLE, PLAME, PDT)</span></li>\n<li><span style="font-family: arial, helvetica, sans-serif;">Emisi&oacute;n de reportes de Libros Contables.</span></li>\n<li><span style="font-family: arial, helvetica, sans-serif;">Integraci&oacute;n de la informaci&oacute;n con el m&oacute;dulo de tesorer&iacute;a y caja chica</span></li>\n</ul>\n</li>\n</ul>\n</li>\n</ul>\n<p style="padding-left: 80px;"><span style="font-family: arial, helvetica, sans-serif;"><strong>b. Tesorer&iacute;a</strong></span></p>\n<ul>\n<li style="list-style-type: none;">\n<ul>\n<li style="list-style-type: none;">\n<ul style="text-align: justify;">\n<li><span style="font-family: arial, helvetica, sans-serif;">Emisi&oacute;n de reportes de cuentas por cobrar y cuentas por pagar</span></li>\n<li><span style="font-family: arial, helvetica, sans-serif;">Conciliaci&oacute;n bancaria</span></li>\n<li><span style="font-family: arial, helvetica, sans-serif;">Liquidaci&oacute;n de pagos masivos - Bancos (Proveedores y haberes)</span></li>\n<li><span style="font-family: arial, helvetica, sans-serif;">Liquidaci&oacute;n de pagos masivos de detracciones - Bancos</span></li>\n<li><span style="font-family: arial, helvetica, sans-serif;">Uso amigable para usuarios no Contables</span></li>\n<li><span style="font-family: arial, helvetica, sans-serif;">Emisi&oacute;n de Flujo de Caja</span></li>\n</ul>\n</li>\n</ul>\n</li>\n</ul>\n<p style="padding-left: 80px;"><span style="font-family: arial, helvetica, sans-serif;"><strong>c. Caja <u>Chica</u></strong></span></p>\n<ul>\n<li style="list-style-type: none;">\n<ul>\n<li style="list-style-type: none;">\n<ul style="text-align: justify;">\n<li><span style="font-family: arial, helvetica, sans-serif;">Es amigable para usuario no Contable</span></li>\n<li><span style="font-family: arial, helvetica, sans-serif;">Captura de gastos por conceptos</span></li>\n<li><span style="font-family: arial, helvetica, sans-serif;">Modulo integrado con la contabilidad y tesorer&iacute;a</span></li>\n</ul>\n</li>\n</ul>\n</li>\n</ul>\n<p style="padding-left: 40px;"><span style="font-family: arial, helvetica, sans-serif;"><strong>2. </strong><strong>Interfaz</strong></span></p>\n<ul>\n<li style="list-style-type: none;">\n<ul style="text-align: justify;">\n<li><span style="font-family: arial, helvetica, sans-serif;">An&aacute;lisis</span></li>\n<li><span style="font-family: arial, helvetica, sans-serif;">Dise&ntilde;o</span></li>\n<li><span style="font-family: arial, helvetica, sans-serif;">Desarrollo</span></li>\n</ul>\n</li>\n</ul>\n<p style="padding-left: 40px;"><span style="font-family: arial, helvetica, sans-serif;"><strong>3. Instalaci&oacute;n y configuraci&oacute;n de sistemas</strong></span></p>\n<p style="padding-left: 40px;"><strong style="font-family: arial, helvetica, sans-serif;">4. Soporte de Sistemas Instalados.</strong></p>\n<p style="padding-left: 40px;"><span style="font-family: arial, helvetica, sans-serif;"><strong>5. Consultas t&eacute;cnicas en l&iacute;nea.</strong></span></p>\n<p style="padding-left: 40px;"><span style="font-family: arial, helvetica, sans-serif;"><strong>6. Soporte acceso remoto.</strong></span></p>\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;"><strong>&nbsp;</strong></span></p>\n<p><span style="font-family: arial, helvetica, sans-serif;"><strong>&nbsp; &nbsp; &nbsp;II.&nbsp; ENTREGABLES:</strong></span></p>\n<ol>\n<li style="list-style-type: none;">\n<ol style="list-style-type: lower-alpha;">\n<li><span style="font-family: arial, helvetica, sans-serif;">Manual del usuario.</span></li>\n<li><span style="font-family: arial, helvetica, sans-serif;">Programa ejecutable versi&oacute;n multiusuario.</span></li>\n</ol>\n</li>\n</ol>\n<p><span style="font-family: arial, helvetica, sans-serif;"><strong>&nbsp; &nbsp; &nbsp;III. SERVICIO POST IMPLEMENTACI&Oacute;N: </strong></span></p>\n<ol>\n<li style="list-style-type: none;">\n<ol style="list-style-type: lower-alpha;">\n<li><span style="font-family: arial, helvetica, sans-serif;">Sesiones de entrenamiento y/o capacitaci&oacute;n de manera virtual a los usuarios previa coordinaci&oacute;n, cada </span><span style="font-family: arial, helvetica, sans-serif;">sesi&oacute;n tiene en promedio de 2 a 3 horas de duraci&oacute;n.</span></li>\n<li><span style="font-family: arial, helvetica, sans-serif;">Asesor&iacute;as telef&oacute;nicas o v&iacute;a mail.</span></li>\n<li><span style="font-family: arial, helvetica, sans-serif;">Las incidencias ser&aacute;n reportadas seg&uacute;n procedimiento establecido v&iacute;a email.</span></li>\n</ol>\n</li>\n</ol>\n<p><span style="font-family: arial, helvetica, sans-serif;"><strong>&nbsp; &nbsp; &nbsp;IV. CONDICIONES Y CONSIDERACIONES GENERALES DE LA CESI&Oacute;N DE USO DEL SISTEMA</strong></span></p>\n<ol>\n<li style="list-style-type: none;">\n<ol style="text-align: justify;">\n<li><span style="font-family: arial, helvetica, sans-serif;">Los m&oacute;dulos son est&aacute;ndar y se instalan sin cambios adicionales.</span></li>\n<li><span style="font-family: arial, helvetica, sans-serif;">Instalaci&oacute;n inmediata.</span></li>\n<li><span style="font-family: arial, helvetica, sans-serif;">Usuarios y compa&ntilde;&iacute;as ilimitados previa evaluaci&oacute;n.</span></li>\n<li><span style="font-family: arial, helvetica, sans-serif;">Instalaci&oacute;n ilimitada en estaciones de trabajo.</span></li>\n</ol>\n</li>\n</ol>\n<p>&nbsp;</p>\n<p><span style="font-family: arial, helvetica, sans-serif;"><strong>&nbsp; &nbsp; &nbsp;V. CONSIDERACIONES T&Eacute;CNICAS:</strong></span></p>\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">El Cliente proporcionar&aacute; los siguientes requerimientos para la operaci&oacute;n de los sistemas dependiendo si los servidores est&aacute;n de manera local o en la nube, seg&uacute;n sea el caso:</span></p>\n<p style="text-align: justify;">&nbsp;</p>\n<ol style="text-align: justify;">\n<li><span style="font-family: arial, helvetica, sans-serif;">Internet de 8 Megas y la comunicaci&oacute;n de los Locales por VPN o IP Publica de ser el caso.</span></li>\n<li><span style="font-family: arial, helvetica, sans-serif;">Red local de datos, cableado de red en categor&iacute;a 6 estructurado (aislado/canaletas) y revisado y probado en los puntos donde se instalar&aacute;n el sistema para los usuarios entre los locales y la comunicaci&oacute;n sea estable.</span></li>\n<li><span style="font-family: arial, helvetica, sans-serif;">Del servidor de datos (SQL), (no considerar de estar el servidor en la nube), equipo de marca HP ProLiant AMD Turion o similar superior, memoria 6.GB, Tarjeta de Red independiente no integrada, Sistema Operativo Windows 2008, 2012 R2 Server, disco duro 500 o superior GB, con arreglo de discos espejo recomendado y pol&iacute;ticas de backup establecidas por seguridad e integridad de la informaci&oacute;n.</span></li>\n<li><span style="font-family: arial, helvetica, sans-serif;">De las estaciones de trabajo (m&iacute;nimo requerido) Corei3 o superior, RAM de 2 GB, Disco Duro de 250 GB Sistema operativo Windows 7, Windows8 o superior 32 bits.</span></li>\n<li><span style="font-family: arial, helvetica, sans-serif;">Licencias para servidores SQL Server, Windows Server 2012 y en estaciones de usuarios y/o instalaci&oacute;n del SQL Express (no es necesario licencia).</span></li>\n<li><span style="font-family: arial, helvetica, sans-serif;">Contar con un UPS para la conexi&oacute;n del servidor y las estaciones de trabajo, autonom&iacute;a de una hora.</span></li>\n</ol>\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">En se&ntilde;al de conformidad, las partes suscriben el 28 de diciembre de 2021.</span></p>', 'https://drive.google.com/open?id=1p82Wv3966NcTiizDvazkQEOZHID-14uu', 4, 2, '2022-04-20 15:56:08');
