INSERT INTO `gd_plantilla` (`PK_PLANTILLA`, `FK_USUARIO_REGISTRA`, `TIPO_DOC_PLANTILLA`, `NOMBRE_PLANTILLA`, `CABECERA_PLANTILLA`, `USUARIOS_PLANTILLA`, `CLAUSULA_PLANTILLA`, `ANEXO_PLANTILLA`, `LOG_PLANTILLA`, `ESTADO_PLANTILLA`, `DELETED_PLANTILLA`, `FECHA_REGISTRO`) VALUES
	(1, 2, 5, 'OCAT', '<h2>&nbsp;</h2>\r\n<h2>&nbsp;</h2>\r\n<h2><span style="font-size: 12pt;"><strong><span style="font-family: arial, helvetica, sans-serif;">ACG 1412.2021 OCAT- II</span></strong></span></h2>', '<pre><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">Se&ntilde;or:</span><br /><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;"><strong>Andrea Benavides</strong></span><br /><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">Gerente General</span><br /><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;"><strong>Aquaworks</strong></span><br /><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;"><u>Presente. -<br /><br /></u></span></pre>', '<p><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">De nuestra consideraci&oacute;n:</span></p>\r\n<p>&nbsp;</p>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">La presente tiene</span><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;"> por </span><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">finalidad atender su amable invitaci&oacute;n, para brindar a su empresa detallada a continuaci&oacute;n, nuestros servicios profesionales en la Asesor&iacute;a Contable, Tributaria y N&oacute;minas:</span></p>\r\n<p>&nbsp;</p>\r\n<p><span style="font-size: 12pt;"><strong><span style="font-family: arial, helvetica, sans-serif;">METODOLOG&Iacute;A DE TRABAJO</span></strong><span style="font-family: arial, helvetica, sans-serif;">&nbsp;</span></span></p>\r\n<p>&nbsp;</p>\r\n<p style="text-align: justify;"><span style="font-size: 12pt;"><strong><span style="font-family: arial, helvetica, sans-serif;">FASE I: ALCANCE DE LA ASESOR&Iacute;A CONTABLE, TRIBUTARIA Y N&Oacute;MINAS</span></strong></span></p>\r\n<p>&nbsp;</p>\r\n<p style="padding-left: 40px;"><span style="text-decoration: underline; font-size: 12pt;"><strong><span style="font-family: arial, helvetica, sans-serif;">CONTABILIDAD GENERAL </span></strong></span></p>\r\n<ul>\r\n<li style="list-style-type: none;">\r\n<ul style="list-style-type: square;">\r\n<li style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">Estructuraci&oacute;n de plan de cuentas y generaci&oacute;n de centro de costos.</span></li>\r\n<li style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">Configuraci&oacute;n del plan de cuentas con los cat&aacute;logos de productos, centro de costos, c&oacute;digos de proveedores, c&oacute;digos de trabajadores, entre otros.</span></li>\r\n<li style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">Implementaci&oacute;n de pol&iacute;ticas contables (cierres mensuales, corte documentario, entre otros).</span></li>\r\n<li style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">Validaci&oacute;n de Facturas por Pagar que se direccionan al Registro de Compras.</span></li>\r\n<li style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">Validaci&oacute;n de Facturas por Cobrar que se direccionan al Registro de Ventas.</span></li>\r\n<li style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">Revisi&oacute;n de las Conciliaciones Bancarias mensuales una vez culminadas y revisadas por el &aacute;rea de Tesorer&iacute;a del cliente.</span></li>\r\n<li style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">Revisi&oacute;n de los c&aacute;lculos de los importes de impuestos por pagar mensualmente elaborados por el &aacute;rea Administrativa o de Recursos Humanos del cliente, tales como Essalud, 5ta y 4ta Categor&iacute;a, ONP.</span></li>\r\n<li style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">Elaboraci&oacute;n de la Liquidaci&oacute;n mensual de impuestos PDT PLAME.</span></li>\r\n<li style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">Elaboraci&oacute;n y Presentaci&oacute;n de los Libros Electr&oacute;nicos (PLE).</span></li>\r\n<li style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">An&aacute;lisis de todas las partidas contables que se encuentran inmersos en la elaboraci&oacute;n de los EEFF, cabe mencionar que las partidas contables de los Inventarios y Consumo de los mismos es brindado por el cliente, siendo su responsabilidad la emisi&oacute;n de estas cifras.</span></li>\r\n<li style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">Provisi&oacute;n de la Depreciaci&oacute;n del Activo Fijo y Amortizaci&oacute;n de Intangibles entregados por el cliente en su oportunidad.</span></li>\r\n<li style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">Preparaci&oacute;n de los papeles de trabajo que sustentan el c&aacute;lculo de los tributos mensuales.</span></li>\r\n<li style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">Elaboraci&oacute;n de la Liquidaci&oacute;n mensual de impuestos PDT 617 Otras Retenciones de ser el caso.</span></li>\r\n<li style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">Elaboraci&oacute;n de la Liquidaci&oacute;n mensual de impuestos PDT 621 IGV- Renta.</span></li>\r\n<li style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">Elaboraci&oacute;n de la Liquidaci&oacute;n mensual de impuestos PDT 626 Agentes de Retenci&oacute;n, de ser el caso.</span></li>\r\n<li style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">Elaboraci&oacute;n de la Liquidaci&oacute;n mensual de impuestos PDT 633 Agentes de Percepci&oacute;n, de ser el caso.</span></li>\r\n<li style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">Formulaci&oacute;n de Estados Financieros e Informaci&oacute;n Gerencial con una periodicidad mensual.</span></li>\r\n<li style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">Exposici&oacute;n de los EEFF con una periodicidad mensual.</span></li>\r\n<li style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">Elaboraci&oacute;n de la Declaraci&oacute;n Jurada Anual del Impuesto a la Renta de 3&deg; Categor&iacute;a y Preparaci&oacute;n de las hojas de trabajo respectivas.</span></li>\r\n<li style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">Preparaci&oacute;n y presentaci&oacute;n de las Declaraciones Informativas a que este obligado el cliente, tales como la declaraci&oacute;n Anual de Operaciones con terceros (DAOT).</span></li>\r\n<li style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">Preparaci&oacute;n y presentaci&oacute;n de las Declaraciones Determinativas a que este obligado el cliente, tales como la del Impuesto Temporal a los Activos Netos (ITAN).</span></li>\r\n<li style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">Atenci&oacute;n de consultas a los requerimientos de informaci&oacute;n y sustento derivado de los procesos de auditoria que mantiene la empresa con servicios de terceros, hasta por un tope de 05 horas al mes.</span></li>\r\n<li style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">Atenci&oacute;n de consultas a los requerimientos de informaci&oacute;n y sustento derivado de los procesos de fiscalizaci&oacute;n parcial iniciados por SUNAT y requerimiento de informaci&oacute;n por SUNAFIL correspondiente a operativos de fiscalizaci&oacute;n.</span></li>\r\n<li style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">Atenci&oacute;n de consultas tributarias y laborales hasta por un tope de 05 al mes, estas no son acumulables para los meses siguientes.</span></li>\r\n</ul>\r\n</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p style="padding-left: 40px;"><span style="text-decoration: underline; font-size: 12pt;"><strong><span style="font-family: arial, helvetica, sans-serif;">N&Oacute;MINAS</span></strong></span></p>\r\n<ul>\r\n<li style="list-style-type: none;">\r\n<ul>\r\n<li><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">C&aacute;lculo de n&oacute;minas</span></li>\r\n<li><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">C&aacute;lculo de Decreto. Ley &ndash; seg&uacute;n condici&oacute;n de cada colaborador</span></li>\r\n<li><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">C&aacute;lculo de Retenciones (5ta, ONP, AFP)</span></li>\r\n<li><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">C&aacute;lculo de vacaciones en cada oportunidad.</span></li>\r\n<li><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">C&aacute;lculo semestral de CTS y Gratificaciones.</span></li>\r\n<li><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">C&aacute;lculo de Participaci&oacute;n de Utilidades de Ley.</span></li>\r\n<li><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">C&aacute;lculo de las Liquidaciones de Beneficios Sociales.</span></li>\r\n<li><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">Preparaci&oacute;n Liquidaci&oacute;n mensual de AFP v&iacute;a AFP NET</span></li>\r\n<li><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">Preparaci&oacute;n del PDT PLAME.</span></li>\r\n<li><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">C&aacute;lculo mensual de provisiones de CTS, Vacaciones y Gratificaciones.</span></li>\r\n</ul>\r\n</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><span style="text-decoration: underline; font-size: 12pt;"><strong><span style="font-family: arial, helvetica, sans-serif;">DEL PERSONAL PARA LA ASESOR&Iacute;A CONTABLE, TRIBUTARIA Y N&Oacute;MINAS</span></strong></span></p>\r\n<ul>\r\n<li><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">01 Contador en nuestras oficinas. </span></li>\r\n<li><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">01 Analista de N&oacute;minas en nuestras oficinas.</span></li>\r\n<li><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">01 Supervisor Contable a tiempo parcial en nuestras oficinas.</span></li>\r\n<li><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">01 Gerente Contable y/o Consultor.</span></li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><span style="font-size: 12pt;"><strong><span style="text-decoration: underline;"><span style="font-family: arial, helvetica, sans-serif;">DE LOS HONORARIOS </span></span></strong></span></p>\r\n<p><span style="font-size: 12pt;"><strong><span style="font-family: arial, helvetica, sans-serif;">ETAPA DE ASESOR&Iacute;A CONTABLE, TRIBUTARIA Y N&Oacute;MINAS</span></strong></span></p>\r\n<p><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">Por la Asesor&iacute;a Contable, Tributaria y N&oacute;minas nuestros honorarios son:</span></p>\r\n<ul style="list-style-type: square;">\r\n<li><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">Enero a Junio del 2022 &nbsp;&nbsp;&egrave;&nbsp; S/. XXXXX</span></li>\r\n<li><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">Julio a&nbsp; Diciembre del 2022 &nbsp;&egrave; &nbsp;S/. XXXXX</span></li>\r\n</ul>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;"><strong>mas el IGV en forma mensual</strong>, los cuales ser&aacute;n cancelados los 15 primeros d&iacute;as de cada mes (mes vigente), que empezar&iacute;an a partir de la aceptaci&oacute;n de la propuesta.</span></p>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">Un pago anual por un honorario vigente adicional, que se realizar&aacute; en el mes de <strong>marzo</strong>, equivalente al importe de facturaci&oacute;n de ese momento, por la preparaci&oacute;n y formulaci&oacute;n de la Declaraci&oacute;n Jurada anual del Impuesto a la Renta, este importe se puede prorratear de manera mensual seg&uacute;n las necesidades del cliente.</span></p>\r\n<p style="text-align: justify;">&nbsp;</p>\r\n<p><span style="text-decoration: underline; font-size: 12pt;"><strong><span style="font-family: arial, helvetica, sans-serif;">CONSIDERACIONES FINALES</span></strong></span></p>\r\n<ol>\r\n<li style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">El cliente deber&aacute; proporcionar lo siguiente:</span>\r\n<ul>\r\n<li><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">Facilidades para acceder <strong>digitalmente a la documentaci&oacute;n</strong>, contratos, correspondencia o cualquier otro documento que permita el debido Registro Contable.</span></li>\r\n</ul>\r\n</li>\r\n<li style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">El cliente deber&aacute; almacenar la informaci&oacute;n digital de manera correlativa en el drive que ser&aacute; asignado bajo los procedimientos indicados.</span></li>\r\n<li style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">De no tener Libros Electr&oacute;nicos, el empaste y la impresi&oacute;n de libros contables ser&aacute;n cubiertos por el cliente.</span></li>\r\n<li style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">El supervisor contable asistir&aacute; a sus instalaciones cuando sea <strong>estrictamente </strong>requerido por la gerencia por temas de atenci&oacute;n parcial SUNAT, Laborales, entre otros, previa coordinaci&oacute;n.</span></li>\r\n<li style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">El &aacute;rea de RRHH del cliente deber&aacute; hacer entrega de la informaci&oacute;n necesaria de n&oacute;minas al &aacute;rea contable para poder realizar el c&aacute;lculo de impuesto en las fechas establecidas del corte documentario, siendo responsabilidad del cliente la ejecuci&oacute;n del pago correspondiente.</span></li>\r\n<li style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">Nuestro personal encargado de la elaboraci&oacute;n de n&oacute;minas, deber&aacute; recibir el tore&oacute; con las incidencias del mes de manera oportuna, seg&uacute;n las fechas de corte establecidas para el proceso.</span></li>\r\n<li style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">Para poder cumplir con el respectivo c&aacute;lculo de n&oacute;minas nuestro analista solicitar&aacute; al &aacute;rea administrativa o Recursos Humanos, las incidencias de las asistencias del personal (tore&oacute;), bajo el formato establecido por nuestra empresa.</span></li>\r\n<li style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">Nuestro servicio de n&oacute;minas no involucra manejo f&iacute;sico de documentos. Para otros tr&aacute;mites que impliquen manejo administrativo de documentos relacionados se considerar&aacute;n tarifas espec&iacute;ficas previamente acordadas con su empresa.</span></li>\r\n<li style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">El servicio de n&oacute;minas, involucra el proceso de c&aacute;lculo de planillas, as&iacute; como el llenado de PLAME y declaraci&oacute;n de obligaciones laborales como AFP, siendo responsabilidad del cliente la ejecuci&oacute;n del pago correspondiente.</span></li>\r\n<li style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">El proceso del servicio y de la supervisi&oacute;n contable se realizar&aacute; <strong>On Line</strong>, y presencial de ser necesario, en cuyo caso el cliente asumir&aacute; los gastos relacionados a los vi&aacute;ticos (movilidad I/D, refrigerio.</span></li>\r\n<li style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">No incluye la Elaboraci&oacute;n de los Kardex ni en Unidades ni Valorizado.</span></li>\r\n<li style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">No incluye la Elaboraci&oacute;n del Flujo de Caja ni Presupuesto.</span></li>\r\n<li style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">No incluye la toma de los inventarios f&iacute;sicos ni de activos ni de mercader&iacute;as.</span></li>\r\n<li style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">Los servicios de planeamiento, estrategia y atenci&oacute;n ante cualquier fiscalizaci&oacute;n de alguna entidad supervisora (SUNAT, SUNAFIL. INEI, etc.), ser&aacute;n cotizadas en funci&oacute;n de las horas que demande dicha gesti&oacute;n (abogados, contadores especializados en temas tributarios y laborales y personal operativo necesario para recabar documentaci&oacute;n e informaci&oacute;n requerida).</span></li>\r\n<li style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">La presente propuesta <span style="text-decoration: underline;"><strong>no incluye</strong></span> la asesor&iacute;a para la adopci&oacute;n de las IFRS &ldquo;Normas Internacionales de Informaci&oacute;n Financiera&rdquo;. Asimismo, la validaci&oacute;n de la Declaraci&oacute;n Anual a la Superintendencia de Mercado de Valores &ldquo;SMV&rdquo;.</span></li>\r\n<li style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">Los servicios que son objeto de la presente propuesta, <span style="text-decoration: underline;"><strong>no incluyen</strong></span> el patrocinio de LA EMPRESA en procedimientos administrativos (fiscalizaciones y procedimientos contenciosos tributarios y/o laborales) y/o judiciales; la realizaci&oacute;n de planificaciones laborales, auditor&iacute;as y todos aquellos encargos que razonablemente no integran una consultor&iacute;a ordinaria.</span></li>\r\n<li style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">La firma del contrato en se&ntilde;al de conformidad por ambas partes, es requisito imprescindible para el inicio de nuestro servicio.</span></li>\r\n</ol>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">S&iacute;rvanse confirmar por escrito la aceptaci&oacute;n de nuestra propuesta, posterior a ello le haremos llegar un Contrato de Locaci&oacute;n de Servicios donde se precisar&aacute;n los puntos ya expuestos.</span></p>\r\n<p>&nbsp;</p>\r\n<p><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">Sin otro particular, quedamos de ustedes.</span></p>\r\n<p><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">Atentamente,</span></p>\r\n<h5>&nbsp;</h5>\r\n<h5><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">ASESORES &amp; CONTADORES GERENCIALES</span></h5>\r\n<p><span style="font-size: 12pt;"><img src="data:image/png;base64," width="70" height="145" /></span></p>\r\n<p><span style="font-size: 12pt;"><strong><span style="font-family: arial, helvetica, sans-serif;">Milton G&oacute;ngora Paniagua</span></strong></span></p>\r\n<p><span style="font-size: 12pt;"><strong><span style="font-family: arial, helvetica, sans-serif;">Gerencia Comercial</span></strong></span></p>', '', NULL, 1, 2, '2022-03-29 12:08:46'),
	(2, 2, 6, 'ISAT', '<h2><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">ACG-3011-2021-ISAT</span></h2>\r\n<p><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">Miraflores,30 de noviembre del 2021</span></p>\r\n<p>&nbsp;</p>\r\n<p><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">Se&ntilde;or,</span></p>', '<pre><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">Andrea Benavides</span><br /><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;"><strong>Gerente General </strong></span><br /><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;"><strong>AquaWorks<br /></strong><span style="text-decoration: underline;">Presente.-<br /><br /></span></span></pre>', '<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">De nuestra consideraci&oacute;n:</span></p>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">La presente tiene por finalidad hacerle llegar nuestra propuesta econ&oacute;mica sobre la cesi&oacute;n de uso de nuestros sistemas (SIIA) Back Office.</span></p>\r\n<p style="text-align: justify;">&nbsp;</p>\r\n<p style="text-align: justify;"><span style="text-decoration: underline; font-family: arial, helvetica, sans-serif; font-size: 12pt;"><strong>METODOLOGIA DE TRABAJO</strong></span></p>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">Nuestro servicio consiste en integrar la informaci&oacute;n contable en una sola base de datos la misma que es generada por los usuarios mediante el sistema de gesti&oacute;n del negocio, con la finalidad de integrar y brindar la informaci&oacute;n, partiendo de un principio, que la informaci&oacute;n se ingresa al sistema una sola vez, por consiguiente, nuestra labor se concentra en la validaci&oacute;n de la informaci&oacute;n en <strong>SIIA</strong> gesti&oacute;n de control y formulaci&oacute;n de reportes.</span></p>\r\n<p><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;"><img style="display: block; margin-left: auto; margin-right: auto;" src="data:image/png;base64," width="614" height="345" /></span></p>\r\n<p style="text-align: justify;">&nbsp;</p>\r\n<p style="text-align: justify;">&nbsp;</p>\r\n<p style="text-align: justify;">&nbsp;</p>\r\n<p style="text-align: justify;">&nbsp;</p>\r\n<p style="text-align: justify;">&nbsp;</p>\r\n<p style="text-align: justify;">&nbsp;</p>\r\n<p style="text-align: justify;">&nbsp;</p>\r\n<p style="text-align: justify;">&nbsp;</p>\r\n<p style="text-align: justify;">&nbsp;</p>\r\n<p style="text-align: justify;">&nbsp;</p>\r\n<p style="text-align: justify;">&nbsp;</p>\r\n<p style="text-align: justify;">&nbsp;</p>\r\n<p style="text-align: justify;">&nbsp;</p>\r\n<p style="text-align: justify;">&nbsp;</p>\r\n<p style="text-align: justify;">&nbsp;</p>\r\n<p style="text-align: justify;">&nbsp;</p>\r\n<p style="text-align: justify;"><span style="text-decoration: underline; font-family: arial, helvetica, sans-serif; font-size: 12pt;"><strong>INTERFACE e IMPLEMENTACION DE SISTEMAS</strong></span></p>\r\n<ol>\r\n<li><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">Despu&eacute;s de la evaluaci&oacute;n realizada y reuniones de aspecto t&eacute;cnico se instalar&aacute; en sus oficinas los siguientes sistemas en el Back Office: <strong>Caja Chica, Contabilidad y Tesorer&iacute;a.</strong></span></li>\r\n</ol>\r\n<p style="text-align: justify;">&nbsp;</p>\r\n<p style="text-align: center;"><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;"><strong>MODULOS SISTEMAS SIIA</strong></span></p>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">A continuaci&oacute;n, mencionamos las principales caracter&iacute;sticas del sistema propuesto.</span></p>\r\n<p><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;"><img style="display: block; margin-left: auto; margin-right: auto;" src="data:image/png;base64," width="410" height="281" /></span></p>\r\n<p style="text-align: justify;">&nbsp;</p>\r\n<p style="text-align: justify;">&nbsp;</p>\r\n<p style="text-align: justify;">&nbsp;</p>\r\n<p style="text-align: justify;">&nbsp;</p>\r\n<p style="text-align: justify;">&nbsp;</p>\r\n<p style="text-align: justify;">&nbsp;</p>\r\n<p style="text-align: justify;">&nbsp;</p>\r\n<p style="text-align: justify;">&nbsp;</p>\r\n<p style="text-align: justify;">&nbsp;</p>\r\n<p style="text-align: justify;">&nbsp;</p>\r\n<p style="text-align: justify;">&nbsp;</p>\r\n<p style="text-align: justify;">&nbsp;</p>\r\n<p style="text-align: justify;">&nbsp;</p>\r\n<p style="text-align: justify;">&nbsp;</p>\r\n<p style="text-align: justify;">&nbsp;</p>\r\n<p style="text-align: justify;">&nbsp;</p>\r\n<p style="text-align: justify;"><span style="text-decoration: underline; font-family: arial, helvetica, sans-serif; font-size: 12pt;"><strong>GENERALIDADES DEL LOS SISTEMAS</strong></span></p>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;"><strong>Contabilidad</strong></span></p>\r\n<ol>\r\n<li><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">Multiempresa</span></li>\r\n<li><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">Multiusuario</span></li>\r\n<li><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">Nivel de perfil de seguridad</span></li>\r\n<li><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">An&aacute;lisis de gastos por centro de costo</span></li>\r\n<li><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">Emisi&oacute;n de reportes anal&iacute;ticos</span></li>\r\n<li><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">Emisi&oacute;n de reporte de estados financieros</span></li>\r\n<li><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">Emisi&oacute;n de reportes para declaraci&oacute;n a SUNAT (PLE, PLAME, PDT)</span></li>\r\n<li><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">Emisi&oacute;n de reportes de Libros Contables.</span></li>\r\n<li><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">Integraci&oacute;n de la informaci&oacute;n con el m&oacute;dulo de tesorer&iacute;a y caja chica</span></li>\r\n</ol>\r\n<p style="text-align: justify;">&nbsp;</p>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;"><strong>Tesorer&iacute;a</strong></span></p>\r\n<ol>\r\n<li><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">Emisi&oacute;n de reportes de cuentas por cobrar y cuentas por pagar</span></li>\r\n<li><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">Conciliaci&oacute;n bancaria</span></li>\r\n<li><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">Liquidaci&oacute;n de pagos masivos - Bancos (Proveedores y haberes)</span></li>\r\n<li><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">Liquidaci&oacute;n de pagos masivos de detracciones - Bancos</span></li>\r\n<li><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">Uso amigable para usuarios no Contables</span></li>\r\n<li><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">Emisi&oacute;n de Flujo de Caja</span></li>\r\n</ol>\r\n<p style="text-align: justify;">&nbsp;</p>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;"><strong>Caja Chica</strong></span></p>\r\n<ol>\r\n<li><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">Es amigable para usuario no Contable</span></li>\r\n<li><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">Captura de gatos por conceptos</span></li>\r\n<li><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">Modulo integrado con la contabilidad y tesorer&iacute;a</span></li>\r\n</ol>\r\n<p style="text-align: justify;">&nbsp;</p>\r\n<p style="text-align: justify;"><span style="text-decoration: underline; font-family: arial, helvetica, sans-serif; font-size: 12pt;"><strong>ALCANCE DEL SERVICIO</strong></span></p>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">Nuestro trabajo comprender&iacute;a 45 d&iacute;as h&aacute;biles a partir de la aceptaci&oacute;n de la presente propuesta para realizar el siguiente alcance:</span></p>\r\n<p><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;"><strong>1. Implementaci&oacute;n de sistemas </strong></span></p>\r\n<ol>\r\n<li style="list-style-type: none;">\r\n<ol>\r\n<li><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">Contabilidad</span></li>\r\n<li><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">Tesorer&iacute;a</span></li>\r\n<li><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">Caja Chica</span></li>\r\n</ol>\r\n</li>\r\n<li style="list-style-type: none;">&nbsp;</li>\r\n</ol>\r\n<p style="text-align: justify;"><strong style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">2. Interfaz con el software de gesti&oacute;n (ventas &egrave; Facturaci&oacute;n electr&oacute;nica cobranza, compras)</strong></p>\r\n<ol>\r\n<li style="list-style-type: none;">\r\n<ol>\r\n<li style="list-style-type: none;">\r\n<ol>\r\n<li><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">An&aacute;lisis</span></li>\r\n<li><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">Dise&ntilde;o</span></li>\r\n<li><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">Desarrollo</span></li>\r\n</ol>\r\n</li>\r\n</ol>\r\n</li>\r\n</ol>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;"><strong>3. Instalaci&oacute;n y configuraci&oacute;n de sistemas</strong></span><br /><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;"><strong>4. Soporte de Sistemas Instalados.</strong></span><br /><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;"><strong>5. Consultas t&eacute;cnicas en l&iacute;nea.</strong></span><br /><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;"><strong>6. Soporte acceso remoto.</strong></span></p>\r\n<p style="text-align: justify;">&nbsp;</p>\r\n<p style="text-align: justify;"><span style="text-decoration: underline; font-family: arial, helvetica, sans-serif; font-size: 12pt;"><strong>DEL PERSONAL </strong></span></p>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">Se asignar&aacute; al siguiente personal para la implementaci&oacute;n de sistemas SIIA</span></p>\r\n<ul>\r\n<li><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">Un Jefe de proyecto</span></li>\r\n<li><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">Un Analista de Sistemas</span></li>\r\n</ul>\r\n<p style="text-align: justify;">&nbsp;</p>\r\n<p style="text-align: justify;"><span style="text-decoration: underline; font-family: arial, helvetica, sans-serif; font-size: 12pt;"><strong>DE LOS HONORARIOS </strong></span></p>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;"><strong>INTERFAZ &ndash; SISTEMA DE GESTION </strong></span></p>\r\n<p style="text-align: justify; padding-left: 40px;"><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">1. An&aacute;lisis, dise&ntilde;o y desarrollo de Interfaces con el sistema de gesti&oacute;n, realizando la migraci&oacute;n de datos de: ventas y tipos de pago, los honorarios ascienden a US$. XXXXX m&aacute;s el I.G.V.</span></p>\r\n<p style="text-align: justify; padding-left: 40px;"><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">2. Los honorarios por la cesi&oacute;n de uso de los sistemas SIIA son de USD. XXXXXX m&aacute;s el I.G.V.</span></p>\r\n<p style="text-align: justify;">&nbsp;</p>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;"><strong><span style="text-decoration: underline;">FORMA DE PAGO</span></strong></span></p>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">El pago por la interfaz ser&aacute; en 6 cuotas, pago por &uacute;nica vez.</span></p>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">Por la cesi&oacute;n de uso de los sistemas <strong>SIIA</strong> el pago se realizar&aacute; los cinco (5) primeros d&iacute;as de cada mes a partir del mes 7.</span></p>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">&nbsp;</span></p>\r\n<p style="text-align: justify;"><span style="text-decoration: underline; font-family: arial, helvetica, sans-serif; font-size: 12pt;"><strong>CONSIDERACIONES y CONDICIONES GENERALES DE LA CESI&Oacute;N DE USO DEL SISTEMA</strong></span></p>\r\n<ol>\r\n<li><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">Los m&oacute;dulos son est&aacute;ndar y se instala sin cambios adicionales</span></li>\r\n<li><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">Instalaci&oacute;n inmediata.</span></li>\r\n<li><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">Usuarios y compa&ntilde;&iacute;as ilimitados previa evaluaci&oacute;n</span></li>\r\n<li><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">Instalaci&oacute;n ilimitada en estaciones de trabajo.</span></li>\r\n</ol>\r\n<p style="text-align: justify;">&nbsp;</p>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;"><strong>Entregables:</strong></span></p>\r\n<ol>\r\n<li><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">Manual del usuario.</span></li>\r\n<li><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">Programa ejecutable versi&oacute;n multiusuario.</span></li>\r\n</ol>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">&nbsp;</span></p>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;"><strong>Servicio post &nbsp;&nbsp;implementaci&oacute;n: </strong></span></p>\r\n<ol>\r\n<li style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">Sesiones de entrenamiento y/o capacitaci&oacute;n de manera virtual a los usuarios previa coordinaci&oacute;n, cada sesi&oacute;n tiene en promedio de 2 a 3 horas de duraci&oacute;n.</span></li>\r\n<li style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">Asesor&iacute;as telef&oacute;nicas o v&iacute;a mail.</span></li>\r\n<li style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">Las incidencias ser&aacute;n reportadas seg&uacute;n procedimiento establecido v&iacute;a email.</span><br /><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">&nbsp;</span></li>\r\n</ol>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;"><strong>Consideraciones T&eacute;cnicas:</strong></span></p>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">El Cliente proporcionar&aacute; los siguientes requerimientos para la operaci&oacute;n de los sistemas dependiendo si los servidores est&aacute;n de manera local o en la nube, seg&uacute;n sea el caso:</span></p>\r\n<ol>\r\n<li style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">Internet de 8 Megas y la comunicaci&oacute;n de lo Locales por VPN o IP Publica de ser el caso.</span></li>\r\n<li style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">Red local de datos, cableado de red en categor&iacute;a 6 estructurado (aislado/canaletas) y revisado y probado en los puntos donde se instalar&aacute;n el sistema para los usuarios entre los locales y la comunicaci&oacute;n sea estable.</span></li>\r\n<li style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">Del servidor de datos (SQL), (no considerar de estar el servidor en la nube), equipo de marca HP ProLiant AMD Turion o similar superior, memoria 6.GB, Tarjeta de Red independiente no integrada, Sistema Operativo Windows 2008, 2012 R2 Server, disco duro 500 o superior GB, con arreglo de discos espejo recomendado y pol&iacute;ticas de backup establecidas por seguridad e integridad de la informaci&oacute;n.</span></li>\r\n<li style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">De las estaciones de trabajo (m&iacute;nimo requerido) Corei3 o superior, RAM de 2 GB, Disco Duro de 250 GB Sistema operativo Windows 7, Windows8 o superior 32 bits.</span></li>\r\n<li style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">Licencias para servidores SQL Server, Windows Server 2012 y en estaciones de usuarios y/o instalaci&oacute;n del SQL Express (no es necesario licencia).</span></li>\r\n<li style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">Contar con un UPS para la conexi&oacute;n del servidor y las estaciones de trabajo, autonom&iacute;a de una hora.</span></li>\r\n</ol>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">&nbsp;</span></p>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">Sin otro particular, quedamos de ustedes.</span></p>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">Atentamente;</span></p>\r\n<p><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;"><img style="float: left;" src="data:image/png;base64," width="62" height="174" /></span></p>\r\n<p style="text-align: left;">&nbsp;</p>\r\n<p style="text-align: left;">&nbsp;</p>\r\n<p style="text-align: left;">&nbsp;</p>\r\n<p style="text-align: left;">&nbsp;</p>\r\n<p style="text-align: left;">&nbsp;</p>\r\n<p style="text-align: left;">&nbsp;</p>\r\n<p style="text-align: left;">&nbsp;</p>\r\n<p style="text-align: left;"><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">Milton G&oacute;ngora Paniagua</span></p>\r\n<p style="text-align: left;"><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">Gerencia Comercial</span></p>', '', NULL, 1, 2, '2022-03-29 12:43:43'),
	(3, 2, 2, 'ALQUILER DEL SISTEMA SIIA', '<p style="text-align: center;"><span style="font-family: arial, helvetica, sans-serif;"><strong>CONTRATO DE SERVICIO ALQUILER DE SISTEMA CONTABLE SIIA</strong></span></p>\r\n<p style="text-align: center;">&nbsp;</p>\r\n<p style="text-align: left;"><span style="font-family: arial, helvetica, sans-serif;">Conste por el presente documento, el Contrato de Alquiler del Sistema Contable SIIA que celebran:</span></p>', '<p><span style="font-family: arial, helvetica, sans-serif;"><strong>A. LA EMPRESA:</strong></span></p>\r\n<p style="padding-left: 40px;"><span style="font-family: arial, helvetica, sans-serif;">NOMBRE&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; : <strong>ACG SOFT S.A.C.</strong></span><br /><span style="font-family: arial, helvetica, sans-serif;">N&Uacute;MERO DE RUC&nbsp; &nbsp;: 20601830931</span><br /><span style="font-family: arial, helvetica, sans-serif;">DOMICILIO&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;: Calle Chinch&oacute;n N&deg; 409 &ndash; Urb. Jard&iacute;n &ndash; San Isidro&nbsp;</span><br /><span style="font-family: arial, helvetica, sans-serif;">REPRESENTANTE&nbsp; &nbsp;: GERENTE GENERAL</span><br /><span style="font-family: arial, helvetica, sans-serif;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Sandra Isabel Cucho G&oacute;ngora</span><br /><span style="font-family: arial, helvetica, sans-serif;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; DNI. N&ordm; 74291478</span></p>\r\n<p><strong><span style="font-family: arial, helvetica, sans-serif;">B. EL CLIENTE:</span></strong></p>\r\n<p style="padding-left: 40px;"><span style="font-family: arial, helvetica, sans-serif;">NOMBRE&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;: <strong>GESTOR DE SOLUCIONES EMPRESARIALES S.A.C</strong></span><br /><span style="font-family: arial, helvetica, sans-serif;">NUMERO DE RUC&nbsp; : 20605122729</span><br /><span style="font-family: arial, helvetica, sans-serif;">DOMICILIO&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; : Calle Talladores N&ordm; 183 Dpto. Ps 1 &ndash; Urb. Artesanos &ndash; Ate - Lima</span><br /><span style="font-family: arial, helvetica, sans-serif;">REPRESENTANTE : GERENTE GENERAL</span><br /><span style="font-family: arial, helvetica, sans-serif;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Andrea Luc&iacute;a Benavides Gil</span><br /><span style="font-family: arial, helvetica, sans-serif;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; DNI. N&ordm; 45394164</span></p>', '<p>&nbsp;</p>\r\n<p><span style="font-family: arial, helvetica, sans-serif;">Bajo los t&eacute;rminos y condiciones contractuales siguientes:</span></p>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;"><strong>CL&Aacute;USULA PRIMERA.</strong> - <strong>LAS PARTES Y ANTECEDENTES</strong>&nbsp;&nbsp;</span></p>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">1.1 LA EMPRESA es una sociedad an&oacute;nima cerrada, debidamente constituida, que desarrolla actividades referidas a los servicios inform&aacute;ticos especializados en mantenimiento y soporte de Software, adem&aacute;s de brindar consultor&iacute;a de gesti&oacute;n de procesos en diversos rubros empresariales.&nbsp;</span></p>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">1.2 EL CLIENTE es una persona jur&iacute;dica de derecho privado cuya actividad principal es <strong><u>elaborar bebidas no alcoh&oacute;licas, producci&oacute;n de agua mineral y otras aguas embotelladas. </u></strong></span></p>\r\n<p style="text-align: justify;">&nbsp;</p>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;"><strong>CL&Aacute;USULA SEGUNDA. - OBJETO DEL CONTRATO </strong>&nbsp;</span></p>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">Por el presente contrato, LA EMPRESA, se obliga a ceder en uso, no exclusiva, a <strong>EL CLIENTE</strong>, del Sistema&nbsp; (SIIA) Back Office, conforme lo detallado en el &ldquo;Anexo 1&rdquo;, que forma parte integrante del presente instrumento.</span></p>\r\n<p style="text-align: justify;">&nbsp;</p>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;"><strong>CL&Aacute;USULA TERCERA. &ndash; OBLIGACIONES DE LA EMPRESA&nbsp;&nbsp; </strong></span></p>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">LA EMPRESA se obliga a cumplir con lo siguiente:</span></p>\r\n<ol style="text-align: justify;">\r\n<li><span style="font-family: arial, helvetica, sans-serif;"><strong> </strong>LA EMPRESA, se obliga a cumplir con los servicios especializados descritos en el ANEXO 1.</span></li>\r\n<li><span style="font-family: arial, helvetica, sans-serif;"><strong> </strong>LA EMPRESA se obliga a mantener la confidencialidad de los documentos que se manejen en la prestaci&oacute;n del servicio a EL CLIENTE.</span></li>\r\n<li><span style="font-family: arial, helvetica, sans-serif;"><strong> </strong>LA EMPRESA, garantiza la idoneidad del servicio prestado en virtud del presente contrato.</span></li>\r\n<li><span style="font-family: arial, helvetica, sans-serif;"><strong> </strong>LA EMPRESA, se obliga a cumplir con los est&aacute;ndares, pol&iacute;ticas, instrucciones y normas de seguridad que EL CLIENTE disponga respecto al acceso a sus instalaciones y cualquier otra.</span></li>\r\n<li><span style="font-family: arial, helvetica, sans-serif;"><strong> </strong>LA EMPRESA responder&aacute;, por los da&ntilde;os y perjuicios ocasionados a <strong>EL CLIENTE </strong>por errores o defectos causados por ella misma o el personal a su servicio en la ejecuci&oacute;n del presente contrato.</span></li>\r\n<li><span style="font-family: arial, helvetica, sans-serif;"><strong> </strong>Estas obligaciones son enunciativas m&aacute;s no limitativas.</span></li>\r\n</ol>\r\n<p style="text-align: justify;">&nbsp;</p>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;"><strong>CL&Aacute;USULA CUARTA. &ndash; OBLIGACIONES DE EL CLIENTE </strong></span></p>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">EL CLIENTE se obliga a cumplir con lo siguiente:</span></p>\r\n<ol style="text-align: justify;">\r\n<li><span style="font-family: arial, helvetica, sans-serif;"><strong>EL CLIENTE</strong>, se obliga a abonar a LA EMPRESA cumplir oportunamente con la retribuci&oacute;n pactada en la cl&aacute;usula cuarta, en caso de incumplimiento se suspender&aacute; el servicio.</span></li>\r\n<li><span style="font-family: arial, helvetica, sans-serif;"><strong>EL CLIENTE</strong>, se obliga a brindar todas las facilidades, el cabal cumplimiento de los servicios especializados de LA EMPRESA.</span></li>\r\n</ol>\r\n<ol style="text-align: justify;">\r\n<li><span style="font-family: arial, helvetica, sans-serif;">Estas obligaciones son enunciativas m&aacute;s no limitativas.</span></li>\r\n</ol>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;"><strong>&nbsp;</strong></span></p>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;"><strong>CL&Aacute;USULA CUARTA. - DE LA CONTRAPRESTACION&nbsp; </strong></span></p>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">Las partes acuerdan que los honorarios se encuentran conformados conforme lo siguiente:</span></p>\r\n<ol style="text-align: justify;">\r\n<li><span style="font-family: arial, helvetica, sans-serif;"><strong> </strong>An&aacute;lisis, dise&ntilde;o y desarrollo de Interfaces con el sistema de gesti&oacute;n, realizando la migraci&oacute;n de datos de: ventas y tipos de pago, los honorarios ascienden a US$. XXXXXX m&aacute;s el IGV.</span></li>\r\n<li><span style="font-family: arial, helvetica, sans-serif;"><strong> </strong>Los honorarios por la cesi&oacute;n de uso de los sistemas SIIA son de US$. XXXXXX m&aacute;s el IGV.</span></li>\r\n</ol>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;"><strong>&nbsp;</strong></span></p>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;"><strong>FORMA DE PAGO</strong></span></p>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">El pago por la interfaz ser&aacute; en 6 cuotas, pago por &uacute;nica vez.</span></p>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">Por la cesi&oacute;n de uso de los sistemas SIIA el pago se realizar&aacute; los 5 primeros d&iacute;as de cada mes a partir del mes 7.</span></p>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">Los comprobantes de pago emitidos como consecuencia de los servicios contratados, deber&aacute;n cancelarse en el mes corriente, dentro de los primeros cinco (05) d&iacute;as del mes vigente por EL CLIENTE, o a trav&eacute;s de un medio de pago v&aacute;lido, de lo contrario, el servicio quedar&aacute; suspendido autom&aacute;ticamente sin necesidad de comunicaci&oacute;n alguna por parte de LA EMPRESA.</span></p>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;"><strong>&nbsp;</strong></span></p>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;"><strong>CL&Aacute;USULA QUINTA. - DE LA CONFIDENCIALIDAD DE LAS PARTES Y ETICA&nbsp; </strong></span></p>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;"><strong>LA EMPRESA,</strong> sus representantes y empleados guardar&aacute;n absoluta reserva y confidencialidad respecto de los servicios objeto del presente contrato, as&iacute; como de cualquier informaci&oacute;n relativa a los negocios u operaciones de <strong>EL CLIENTE</strong>, incluyendo, entre otros, las t&eacute;cnicas industriales, m&eacute;todos de sistemas y de todo elemento constitutivo de la propiedad industrial, resultados, documentaci&oacute;n e informaci&oacute;n de <strong>EL CLIENTE</strong> a los que pudiera tener acceso o conocimiento en virtud del presente contrato, debiendo guardar discreci&oacute;n absoluta sobre estas informaciones. Esta obligaci&oacute;n subsistir&aacute; hasta despu&eacute;s de un (01) a&ntilde;o de terminado el presente contrato.</span></p>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;"><strong>EL CLIENTE</strong> no podr&aacute; contratar o sub contratar empleados o ex empleados Especialistas de Servicio de LA EMPRESA sin la expresa aprobaci&oacute;n de misma hasta 02 a&ntilde;os posteriores a su cese oficial<strong>. EL CLIENTE</strong> declara que en caso de contravenir la presente obligaci&oacute;n reconocer&aacute; a favor de <strong>LA EMPRESA</strong> un importe equivalente a dos (02) a&ntilde;os de la contraprestaci&oacute;n econ&oacute;mica pactada en el contrato.</span></p>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;"><strong>&nbsp;</strong></span></p>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;"><strong>CL&Aacute;USULA SEXTA. - DE LA DURACI&Oacute;N DEL CONTRATO&nbsp; </strong></span></p>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">El presente contrato se suscribe por el plazo de un (01) a&ntilde;o, que empezar&aacute; a computarse a partir del 01 de enero de 2022 y terminar&aacute; el 31 de diciembre del 2022.</span></p>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">Queda expresamente pactado que salvo en caso de comunicaci&oacute;n expresa en sentido contrario, comunicada dentro de cuarenta y cinco d&iacute;as antes del vencimiento del plazo del presente contrato, &eacute;ste quedar&aacute; autom&aacute;ticamente renovado por sucesivos periodos de igual duraci&oacute;n.</span></p>\r\n<p style="text-align: justify;">&nbsp;</p>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;"><strong>CL&Aacute;USULA SEPTIMA.- RESOLUCI&Oacute;N </strong>&nbsp;</span><span style="font-family: arial, helvetica, sans-serif;"><strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</strong></span></p>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;"><strong>EL CLIENTE</strong>, podr&aacute; resolver el presente Contrato ante el cumplimiento parcial, tard&iacute;o o defectuoso o el incumplimiento por parte de <strong>LA EMPRESA</strong> de cualquiera de las obligaciones establecidas en el presente documento y sus anexos, para lo cual <strong>EL CLIENTE</strong> deber&aacute; comunicar por escrito su decisi&oacute;n de resolver, recibida dicha comunicaci&oacute;n por la otra parte, el Contrato se entender&aacute; resuelto.</span></p>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">Las partes acuerdan que, el presente contrato puede ser resuelto por decisi&oacute;n unilateral de cualquiera de las partes, para lo cual la parte que desee resolver el presente contrato deber&aacute; notificar a la otra con una antelaci&oacute;n de cuarenta y cinco (45) d&iacute;as calendario. La presente resoluci&oacute;n no acarreara penalidad alguna.&nbsp;</span></p>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">&nbsp;<strong>&nbsp;</strong>&nbsp;</span></p>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;"><strong>CL&Aacute;USULA OCTAVA.- INTERPRETACION, JURISDICCION Y COMPETENCIA </strong>&nbsp;&nbsp;</span></p>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">La interpretaci&oacute;n del presente contrato, se ajustar&aacute; al texto del mismo y, en su defecto, al C&oacute;digo Civil y a los principios generales del derecho.&nbsp;</span></p>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">Las partes acuerdan de forma expresa que cualquier controversia o diferencia con relaci&oacute;n a la existencia, validez, cumplimiento o ejecuci&oacute;n del presente contrato ser&aacute; resuelta por un &aacute;rbitro &uacute;nico nombrado por la C&aacute;mara Peruana de Arbitraje Mercantil, instituci&oacute;n a la cual las partes confieren el encargo de designaci&oacute;n conforme al inciso 3&ordm; del art&iacute;culo 22&ordm; del Decreto Legislativo N&ordm; 1071. Para tal prop&oacute;sito, las partes acuerdan y aceptan que el citado &aacute;rbitro sustanciara el proceso como un arbitraje de derecho y conforme a las reglas que considere m&aacute;s apropiadas de acuerdo a las circunstancias del caso y teniendo en cuenta el Decreto Legislativo N&ordm; 1071. Y por ende los intervinientes se&ntilde;alan como sus domicilios los consignados en la introducci&oacute;n del presente documento, a donde se les tendr&aacute; por notificados en forma v&aacute;lida.</span></p>\r\n<p style="text-align: justify;">&nbsp;</p>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;"><strong>CL&Aacute;USULA NOVENA. -&nbsp; ACEPTACI&Oacute;N </strong>&nbsp;</span></p>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">Las partes, aceptan todas y cada una de las cl&aacute;usulas establecidas en el presente contrato y se obligan a su fiel cumplimiento, en se&ntilde;al de conformidad firman el 28 de diciembre del 2021</span></p>', '<p style="text-align: center;"><span style="font-family: arial, helvetica, sans-serif;"><strong><u>ANEXO N&deg; 1</u></strong></span></p>\r\n<p style="text-align: justify;">&nbsp;</p>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">Las partes acuerdan que el presente Anexo 1, establece el alcance del servicio materia de contrataci&oacute;n:</span></p>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">El servicio materia de contrataci&oacute;n consiste en integrar la informaci&oacute;n contable en una sola base de datos la misma que es generada por los usuarios mediante un sistema de gesti&oacute;n con la finalidad de integrar y brindar informaci&oacute;n, partiendo de un principio, que la informaci&oacute;n se ingresa al sistema una sola vez, nuestro servicio se concentra en la validaci&oacute;n de la informaci&oacute;n en SIIA&nbsp; gesti&oacute;n de control y formulaci&oacute;n de reportes.</span></p>\r\n<p style="text-align: justify;">&nbsp;</p>\r\n<p><span style="font-family: arial, helvetica, sans-serif;"><strong>&nbsp; &nbsp; &nbsp;I. INTERFACE E IMPLEMENTACI&Oacute;N DE SISTEMAS</strong></span></p>\r\n<p style="padding-left: 40px;"><span style="font-family: arial, helvetica, sans-serif;"><strong>1. </strong><strong>Implementaci&oacute;n de sistemas </strong></span></p>\r\n<p style="padding-left: 80px;"><span style="font-family: arial, helvetica, sans-serif;"><strong>a. <u>Contabilidad</u></strong></span></p>\r\n<ul>\r\n<li style="list-style-type: none;">\r\n<ul>\r\n<li style="list-style-type: none;">\r\n<ul style="text-align: justify;">\r\n<li><span style="font-family: arial, helvetica, sans-serif;">Multiempresa</span></li>\r\n<li><span style="font-family: arial, helvetica, sans-serif;">Multiusuario</span></li>\r\n<li><span style="font-family: arial, helvetica, sans-serif;">Nivel de perfil de seguridad</span></li>\r\n<li><span style="font-family: arial, helvetica, sans-serif;">An&aacute;lisis de gastos por centro de costo</span></li>\r\n<li><span style="font-family: arial, helvetica, sans-serif;">Emisi&oacute;n de reportes anal&iacute;ticos</span></li>\r\n<li><span style="font-family: arial, helvetica, sans-serif;">Emisi&oacute;n de reporte de estados financieros</span></li>\r\n<li><span style="font-family: arial, helvetica, sans-serif;">Emisi&oacute;n de reportes para declaraci&oacute;n a SUNAT (PLE, PLAME, PDT)</span></li>\r\n<li><span style="font-family: arial, helvetica, sans-serif;">Emisi&oacute;n de reportes de Libros Contables.</span></li>\r\n<li><span style="font-family: arial, helvetica, sans-serif;">Integraci&oacute;n de la informaci&oacute;n con el m&oacute;dulo de tesorer&iacute;a y caja chica</span></li>\r\n</ul>\r\n</li>\r\n</ul>\r\n</li>\r\n</ul>\r\n<p style="padding-left: 80px;"><span style="font-family: arial, helvetica, sans-serif;"><strong>b. Tesorer&iacute;a</strong></span></p>\r\n<ul>\r\n<li style="list-style-type: none;">\r\n<ul>\r\n<li style="list-style-type: none;">\r\n<ul style="text-align: justify;">\r\n<li><span style="font-family: arial, helvetica, sans-serif;">Emisi&oacute;n de reportes de cuentas por cobrar y cuentas por pagar</span></li>\r\n<li><span style="font-family: arial, helvetica, sans-serif;">Conciliaci&oacute;n bancaria</span></li>\r\n<li><span style="font-family: arial, helvetica, sans-serif;">Liquidaci&oacute;n de pagos masivos - Bancos (Proveedores y haberes)</span></li>\r\n<li><span style="font-family: arial, helvetica, sans-serif;">Liquidaci&oacute;n de pagos masivos de detracciones - Bancos</span></li>\r\n<li><span style="font-family: arial, helvetica, sans-serif;">Uso amigable para usuarios no Contables</span></li>\r\n<li><span style="font-family: arial, helvetica, sans-serif;">Emisi&oacute;n de Flujo de Caja</span></li>\r\n</ul>\r\n</li>\r\n</ul>\r\n</li>\r\n</ul>\r\n<p style="padding-left: 80px;"><span style="font-family: arial, helvetica, sans-serif;"><strong>c. Caja <u>Chica</u></strong></span></p>\r\n<ul>\r\n<li style="list-style-type: none;">\r\n<ul>\r\n<li style="list-style-type: none;">\r\n<ul style="text-align: justify;">\r\n<li><span style="font-family: arial, helvetica, sans-serif;">Es amigable para usuario no Contable</span></li>\r\n<li><span style="font-family: arial, helvetica, sans-serif;">Captura de gastos por conceptos</span></li>\r\n<li><span style="font-family: arial, helvetica, sans-serif;">Modulo integrado con la contabilidad y tesorer&iacute;a</span></li>\r\n</ul>\r\n</li>\r\n</ul>\r\n</li>\r\n</ul>\r\n<p style="padding-left: 40px;"><span style="font-family: arial, helvetica, sans-serif;"><strong>2. </strong><strong>Interfaz</strong></span></p>\r\n<ul>\r\n<li style="list-style-type: none;">\r\n<ul style="text-align: justify;">\r\n<li><span style="font-family: arial, helvetica, sans-serif;">An&aacute;lisis</span></li>\r\n<li><span style="font-family: arial, helvetica, sans-serif;">Dise&ntilde;o</span></li>\r\n<li><span style="font-family: arial, helvetica, sans-serif;">Desarrollo</span></li>\r\n</ul>\r\n</li>\r\n</ul>\r\n<p style="padding-left: 40px;"><span style="font-family: arial, helvetica, sans-serif;"><strong>3. Instalaci&oacute;n y configuraci&oacute;n de sistemas</strong></span></p>\r\n<p style="padding-left: 40px;"><strong style="font-family: arial, helvetica, sans-serif;">4. Soporte de Sistemas Instalados.</strong></p>\r\n<p style="padding-left: 40px;"><span style="font-family: arial, helvetica, sans-serif;"><strong>5. Consultas t&eacute;cnicas en l&iacute;nea.</strong></span></p>\r\n<p style="padding-left: 40px;"><span style="font-family: arial, helvetica, sans-serif;"><strong>6. Soporte acceso remoto.</strong></span></p>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;"><strong>&nbsp;</strong></span></p>\r\n<p><span style="font-family: arial, helvetica, sans-serif;"><strong>&nbsp; &nbsp; &nbsp;II.&nbsp; ENTREGABLES:</strong></span></p>\r\n<ol>\r\n<li style="list-style-type: none;">\r\n<ol style="list-style-type: lower-alpha;">\r\n<li><span style="font-family: arial, helvetica, sans-serif;">Manual del usuario.</span></li>\r\n<li><span style="font-family: arial, helvetica, sans-serif;">Programa ejecutable versi&oacute;n multiusuario.</span></li>\r\n</ol>\r\n</li>\r\n</ol>\r\n<p><span style="font-family: arial, helvetica, sans-serif;"><strong>&nbsp; &nbsp; &nbsp;III. SERVICIO POST IMPLEMENTACI&Oacute;N: </strong></span></p>\r\n<ol>\r\n<li style="list-style-type: none;">\r\n<ol style="list-style-type: lower-alpha;">\r\n<li><span style="font-family: arial, helvetica, sans-serif;">Sesiones de entrenamiento y/o capacitaci&oacute;n de manera virtual a los usuarios previa coordinaci&oacute;n, cada </span><span style="font-family: arial, helvetica, sans-serif;">sesi&oacute;n tiene en promedio de 2 a 3 horas de duraci&oacute;n.</span></li>\r\n<li><span style="font-family: arial, helvetica, sans-serif;">Asesor&iacute;as telef&oacute;nicas o v&iacute;a mail.</span></li>\r\n<li><span style="font-family: arial, helvetica, sans-serif;">Las incidencias ser&aacute;n reportadas seg&uacute;n procedimiento establecido v&iacute;a email.</span></li>\r\n</ol>\r\n</li>\r\n</ol>\r\n<p><span style="font-family: arial, helvetica, sans-serif;"><strong>&nbsp; &nbsp; &nbsp;IV. CONDICIONES Y CONSIDERACIONES GENERALES DE LA CESI&Oacute;N DE USO DEL SISTEMA</strong></span></p>\r\n<ol>\r\n<li style="list-style-type: none;">\r\n<ol style="text-align: justify;">\r\n<li><span style="font-family: arial, helvetica, sans-serif;">Los m&oacute;dulos son est&aacute;ndar y se instalan sin cambios adicionales.</span></li>\r\n<li><span style="font-family: arial, helvetica, sans-serif;">Instalaci&oacute;n inmediata.</span></li>\r\n<li><span style="font-family: arial, helvetica, sans-serif;">Usuarios y compa&ntilde;&iacute;as ilimitados previa evaluaci&oacute;n.</span></li>\r\n<li><span style="font-family: arial, helvetica, sans-serif;">Instalaci&oacute;n ilimitada en estaciones de trabajo.</span></li>\r\n</ol>\r\n</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<p><span style="font-family: arial, helvetica, sans-serif;"><strong>&nbsp; &nbsp; &nbsp;V. CONSIDERACIONES T&Eacute;CNICAS:</strong></span></p>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">El Cliente proporcionar&aacute; los siguientes requerimientos para la operaci&oacute;n de los sistemas dependiendo si los servidores est&aacute;n de manera local o en la nube, seg&uacute;n sea el caso:</span></p>\r\n<p style="text-align: justify;">&nbsp;</p>\r\n<ol style="text-align: justify;">\r\n<li><span style="font-family: arial, helvetica, sans-serif;">Internet de 8 Megas y la comunicaci&oacute;n de los Locales por VPN o IP Publica de ser el caso.</span></li>\r\n<li><span style="font-family: arial, helvetica, sans-serif;">Red local de datos, cableado de red en categor&iacute;a 6 estructurado (aislado/canaletas) y revisado y probado en los puntos donde se instalar&aacute;n el sistema para los usuarios entre los locales y la comunicaci&oacute;n sea estable.</span></li>\r\n<li><span style="font-family: arial, helvetica, sans-serif;">Del servidor de datos (SQL), (no considerar de estar el servidor en la nube), equipo de marca HP ProLiant AMD Turion o similar superior, memoria 6.GB, Tarjeta de Red independiente no integrada, Sistema Operativo Windows 2008, 2012 R2 Server, disco duro 500 o superior GB, con arreglo de discos espejo recomendado y pol&iacute;ticas de backup establecidas por seguridad e integridad de la informaci&oacute;n.</span></li>\r\n<li><span style="font-family: arial, helvetica, sans-serif;">De las estaciones de trabajo (m&iacute;nimo requerido) Corei3 o superior, RAM de 2 GB, Disco Duro de 250 GB Sistema operativo Windows 7, Windows8 o superior 32 bits.</span></li>\r\n<li><span style="font-family: arial, helvetica, sans-serif;">Licencias para servidores SQL Server, Windows Server 2012 y en estaciones de usuarios y/o instalaci&oacute;n del SQL Express (no es necesario licencia).</span></li>\r\n<li><span style="font-family: arial, helvetica, sans-serif;">Contar con un UPS para la conexi&oacute;n del servidor y las estaciones de trabajo, autonom&iacute;a de una hora.</span></li>\r\n</ol>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">En se&ntilde;al de conformidad, las partes suscriben el 28 de diciembre de 2021.</span></p>', NULL, 1, 2, '2022-03-29 15:11:45'),
	(4, 2, 2, 'CONTRATO DE OUTSOURCING CONTABLE Y ASESORIA TRIBUTARIA', '<p style="text-align: center;"><strong>CONTRATO DE OUTSOURCING CONTABLE Y ASESORIA TRIBUTARIA</strong></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><span style="font-family: arial, helvetica, sans-serif;">Conste por el presente instrumento el &ldquo;<strong>Contrato de</strong> <strong>Outsourcing Contable y Asesor&iacute;a Tributaria&rdquo;</strong> que celebran:</span></p>', '<pre><span style="font-family: arial, helvetica, sans-serif;"><strong>A. DE LA EMPRESA:</strong></span></pre>\r\n<pre style="padding-left: 40px;"><span style="font-family: arial, helvetica, sans-serif;">NOMBRE&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;        :<strong> </strong><strong>AQUAWORKS PERU SAC</strong><strong> </strong></span><br /><span style="font-family: arial, helvetica, sans-serif;">NUMERO DE RUC    : 20508251832</span><br /><span style="font-family: arial, helvetica, sans-serif;">DOMICILIO&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;         : Calle Talladores N&ordm; 183 Dpto. Ps 1 Urb. Los Artesanos - Ate - Lima</span><br /><span style="font-family: arial, helvetica, sans-serif;">REPRESENTANTE    : GERENTE GENERAL</span><br /><span style="font-family: arial, helvetica, sans-serif;">                                      ANDREA LUC&Iacute;A BENAVIDES GIL</span><br /><span style="font-family: arial, helvetica, sans-serif;">                 &nbsp;&nbsp;                  DNI N&ordm; 45394164</span><br /><br /></pre>\r\n<pre><span style="font-family: arial, helvetica, sans-serif;"><strong>B. </strong><strong>EL OUTSOURCER</strong>:</span></pre>\r\n<pre style="padding-left: 40px;"><span style="font-family: arial, helvetica, sans-serif;">NOMBRE&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;        : <strong>GESTOR DE SOLUCIONES EMPRESARIALES S.A.C</strong></span><br /><span style="font-family: arial, helvetica, sans-serif;">N&Uacute;MERO DE RUC    : 20605468927</span><br /><span style="font-family: arial, helvetica, sans-serif;">DOMICILIO&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;         : Calle Chinch&oacute;n N&deg; 409 Urbanizaci&oacute;n Jard&iacute;n &ndash; San Isidro - Lima</span><br /><span style="font-family: arial, helvetica, sans-serif;">REPRESENTANTE    : GERENTE GENERAL</span><br /><span style="font-family: arial, helvetica, sans-serif;">                                     LUIS FELIPE SARAVIA MUNAYCO </span><br /><span style="font-family: arial, helvetica, sans-serif;">                                   &nbsp;&nbsp;DNI. N&ordm; 46995351</span></pre>', '<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;"><strong>LA EMPRESA</strong> y <strong>EL OUTSOURCER</strong>, en adelante, podr&aacute;n ser denominadas, individualmente, &ldquo;<strong>la Parte</strong>&rdquo; y, conjuntamente, &ldquo;<strong>las Partes</strong>&rdquo;, reconoci&eacute;ndose mutuamente capacidad jur&iacute;dica y de obrar suficiente para la celebraci&oacute;n del presente Contrato</span></p>\r\n<p><span style="font-family: arial, helvetica, sans-serif;"><strong>PRIMERO . ANTECEDENTES</strong></span></p>\r\n<p style="padding-left: 40px; text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;"><strong>1.1. LA EMPRESA</strong> es una persona jur&iacute;dica de derecho privado constituida en el Per&uacute; y regulada por las leyes de la Rep&uacute;blica del Per&uacute;, cuya actividad principal es <strong><u>elaborar bebidas no alcoh&oacute;licas, producci&oacute;n de aguas minerales y otras aguas embotelladas</u></strong><strong><u>.</u></strong></span></p>\r\n<p style="padding-left: 40px; text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;"><strong>1.2. EL OUTSOURCER</strong> es una persona jur&iacute;dica constituida en el Per&uacute; y regulada por las leyes de la Rep&uacute;blica del Per&uacute;, que tiene por objeto social la prestaci&oacute;n de servicios de asesor&iacute;a y consultor&iacute;a empresarial, tributario, financiero, contable, administrativo, sistemas, entre otros, contando para dichos efectos con personal especializado.</span></p>\r\n<p>&nbsp;</p>\r\n<p><span style="font-family: arial, helvetica, sans-serif;"><strong>SEGUNDO. OBJETO DEL CONTRATO</strong></span></p>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">Por el presente documento, y al amparo de lo dispuesto por los art&iacute;culos 1755&ordm; y siguientes del C&oacute;digo Civil, <strong>LA EMPRESA</strong> conviene en contratar con <strong>EL OUTSOURCER</strong> para que preste el servicio de asesor&iacute;a profesional detallados en el &ldquo;<strong>Anexo 1</strong>&rdquo; que forma parte integrante del presente instrumento.</span></p>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">Este servicio deber&aacute; prestarse en forma independiente y aut&oacute;noma, asumiendo los riesgos propios de la actividad, en virtud a que cuenta con una organizaci&oacute;n adecuada y permanente para llevarlos a cabo. Para la prestaci&oacute;n de tales servicios, <strong>EL OUTSOURCER</strong> delegar&aacute; en los trabajadores que contrate, la realizaci&oacute;n de los servicios que requiera <strong>LA EMPRESA</strong> debiendo recibir las facilidades del caso por parte de esta, para que puedan cumplir con el objeto del contrato.</span></p>\r\n<p>&nbsp;</p>\r\n<p><span style="font-family: arial, helvetica, sans-serif;"><strong>TERCERO. TERCERIZACION DE SERVICIOS </strong></span></p>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">El presente contrato de <strong>OUTSOURCER</strong> no es un contrato de intermediaci&oacute;n laboral entre una empresa usuaria y una empresa de servicio, pues el mismo es celebrado entre las partes al amparo de lo dispuesto por la Ley 29245, ley que regula las actividades de las empresas especiales y el art&iacute;culo 4 de su Reglamento, aprobado por el DS 006.2008-TR.</span></p>\r\n<p><span style="font-family: arial, helvetica, sans-serif;"><strong>&nbsp;</strong></span></p>\r\n<p><span style="font-family: arial, helvetica, sans-serif;"><strong>CUARTO. PLAZO</strong></span></p>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">El plazo del contrato es de un (01) a&ntilde;o, que empezar&aacute; a computarse a partir de 01 de enero del 2022 y que vencer&aacute; indefectiblemente el 31 de diciembre del 2022. Queda expresamente pactado que salvo en caso de comunicaci&oacute;n expresa comunicada con 45 d&iacute;as antes del plazo del presente contrato, &eacute;ste quedar&aacute; autom&aacute;ticamente renovado por un plazo igual al de su vencimiento.</span></p>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">Al vencimiento del contrato, <strong>EL OUTSOURCER</strong> se compromete a entregar a <strong>LA EMPRESA</strong> todos los documentos confidenciales de &eacute;sta que se encuentren en poder de <strong>EL OUTSOURCER</strong> como consecuencia de la prestaci&oacute;n de sus servicios.</span></p>\r\n<p>&nbsp;</p>\r\n<p><span style="font-family: arial, helvetica, sans-serif;"><strong>QUINTO. RETRIBUCI&Oacute;N</strong></span></p>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">Las partes acuerdan que el pago por los servicios de <strong>EL OUTSOURCER</strong> se encuentra determinado en el &ldquo;<strong>Anexo 2</strong>&rdquo; que forma parte integrante del presente instrumento, y se deber&aacute; realizar dentro de los 15 (quince) d&iacute;as de recepcionada la factura emitida por <strong>EL OUTSOURCER</strong> conforme con la calendarizaci&oacute;n pactada en el &ldquo;<strong>Anexo 2</strong>&rdquo; antes indicado.</span></p>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">Las partes acuerdan que los costos y gastos que se efect&uacute;en por el cumplimiento de cualquier prestaci&oacute;n adicional, servicio de asesor&iacute;a ordinaria, tales como gastos notariales, registrales, aranceles judiciales, tasas administrativas, empleos de personal auxiliar, fotocopias, &uacute;tiles de oficina que son empleados para el debido archivo de los documentos, vi&aacute;ticos y pasajes empleados para el env&iacute;o y recepci&oacute;n de documentos en Lima y fuera de esta y otros gastos afines, ser&aacute;n asumidos por <strong>LA EMPRESA</strong> y ser&aacute;n cancelados en el plazo se&ntilde;alado en el p&aacute;rrafo precedente.</span></p>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">En caso de incumplimiento en el pago oportuno de las obligaciones antes indicadas, <strong>EL OUTSOURCER</strong> tendr&aacute; leg&iacute;timo derecho de cobrar intereses compensatorios y moratorios a la m&aacute;xima tasa permitida por la legislaci&oacute;n vigente, no siendo necesario remitir comunicaci&oacute;n alguna a <strong>LA EMPRESA</strong> para intimarla en mora.</span></p>\r\n<p>&nbsp;</p>\r\n<p><span style="font-family: arial, helvetica, sans-serif;"><strong>SEXTO. CARACTER&Iacute;STICAS DEL CONTRATO</strong></span></p>\r\n<p style="padding-left: 40px; text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">6.1. El presente contrato es de servicio at&iacute;pico, conocido como Contrato de Outsourcing, se regir&aacute; por las normas contenidas en el C&oacute;digo Civil en lo que le sean aplicables.</span></p>\r\n<p style="text-align: justify; padding-left: 40px;"><span style="font-family: arial, helvetica, sans-serif;">6.2 Queda expresamente se&ntilde;alado, que en lo que le sea aplicable a la naturaleza at&iacute;pica del presente contrato, a las relaciones laborales existentes entre <strong>EL OUTSOURCER</strong> y su personal se aplicar&aacute;n la Ley No 29245, debidamente modificada por el Decreto Legislativo No. 1038 y su Reglamento aprobado por el Decreto Supremo No 006-2008-TR.</span></p>\r\n<p style="padding-left: 40px; text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">6.3 <strong>LAS PARTES</strong> declaran que la firma del presente contrato es se&ntilde;al de conformidad para ambos, siendo necesario y un requisito imprescindible para el inicio del servicio</span></p>\r\n<p style="padding-left: 40px; text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">6.4. Queda expresamente pactado, que <strong>EL OUTSOURCER</strong> no ser&aacute; responsable por los actos que hayan sido realizados o dejados de realizar con anterioridad a la vigencia del presente contrato. &nbsp;</span></p>\r\n<p><span style="font-family: arial, helvetica, sans-serif;"><strong>&nbsp;</strong></span></p>\r\n<p><span style="font-family: arial, helvetica, sans-serif;"><strong>SEPTIMO. AUTONOMIA EN LA PRESTACI&Oacute;N DE LOS SERVICIOS</strong></span></p>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">Las partes declaran expresamente que <strong>LA EMPRESA</strong> no tiene ninguna relaci&oacute;n laboral con los trabajadores designados por <strong>EL OUTSOURCER</strong> para brindar la asesor&iacute;a objeto del presente contrato, por lo que no existe relaci&oacute;n alguna de dependencia o subordinaci&oacute;n entre el personal de <strong>EL OUTSOURCER</strong> y <strong>LA EMPRESA.&nbsp; </strong></span></p>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">Por lo tanto, las partes reconocen que los trabajadores de <strong>EL OUTSOURCER</strong> se regir&aacute;n por siguientes caracter&iacute;sticas y condiciones:</span></p>\r\n<ol style="list-style-type: lower-alpha;">\r\n<li style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">Las instrucciones y sanciones que reciban el personal designado por <strong>EL OUTSOURCER</strong> para la prestaci&oacute;n del servicio a <strong>LA EMPRESA</strong>, &uacute;nicamente puede provenir de <strong>EL OUTSOURCER</strong></span></li>\r\n<li style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">Las partes reconocen que las labores prestadas por el personal designado por <strong>EL OUTSOURCER</strong> no son similares a ninguna labor que lleven a cabo los trabajadores de <strong>LA EMPRESA</strong>.</span></li>\r\n<li style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">Es potestad exclusiva de <strong>EL OUTSOURCER</strong> fijar la jornada laboral y el horario de trabajo de sus trabajadores, no pudiendo delegar dicho control a <strong>LA EMPRESA</strong>, quien reconoce por este acto, la autonom&iacute;a plena y absoluta de <strong>EL OUTSOURCER</strong> en este aspecto.</span></li>\r\n<li style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">Es facultad exclusiva de <strong>EL OUTSOURCER</strong> decidir sobre la rotaci&oacute;n del personal designado por &eacute;ste, para la realizaci&oacute;n de las labores materia del presente contrato, no siendo necesario la autorizaci&oacute;n ni el consentimiento de <strong>LA EMPRESA</strong>. En este sentido, <strong>LA EMPRESA</strong> declara expresamente que reconoce la autonom&iacute;a empresarial de <strong>EL OUTSOURCER </strong>sobre los<strong> </strong>trabajadores designados por &eacute;ste, comprometi&eacute;ndose a implementar las pol&iacute;ticas y controles necesarios para evitar cualquier tipo de conflicto derivado del ejercicio de la subordinaci&oacute;n que los trabajadores tienen frente a <strong>EL OUTSOURCER</strong></span></li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<p><span style="font-family: arial, helvetica, sans-serif;"><strong>OCTAVO. OBLIGACIONES DE LAS PARTES</strong></span></p>\r\n<p style="padding-left: 40px; text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">8.1. <strong>LA EMPRESA</strong> se obliga a abonar al <strong>OUTSOURCER</strong> la retribuci&oacute;n pactada en la forma y oportunidad acordada, siempre que <strong>EL OUTSOURCER</strong> cumpla con el objeto del contrato previsto en la Cl&aacute;usula segunda del presente contrato, previa emisi&oacute;n de la factura.</span></p>\r\n<p style="padding-left: 40px; text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">8.2 <strong>LA EMPRESA </strong>se obliga a<strong> </strong>brindar las facilidades para el cabal cumplimiento de las funciones asignadas a <strong>EL OUTSOURCER</strong> de manera oportuna. Para tal efecto, <strong>LA EMPRESA</strong> deber&aacute; entregar en el plazo m&aacute;ximo de tres (03) d&iacute;as h&aacute;biles desde el requerimiento de <strong>EL OUTSOURCER</strong>, toda la documentaci&oacute;n para el debido registro contable donde se encuentran incluidas las conciliaciones bancarias. Ello incluye brindar facilidades para acceder a documentaci&oacute;n, contratos, correspondencia o cualquier otro documento que permita el debido Registro Contable</span></p>\r\n<p style="padding-left: 40px; text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">8.3. <strong>LA EMPRESA </strong>se obliga a<strong> </strong>entregar las copias de contratos que se firmen con las empresas y cualquier otra informaci&oacute;n que generen transacciones, las que al no ser registradas puedan distorsionar los saldos de la informaci&oacute;n financiera. Asimismo, se obliga a entregar oportunamente la documentaci&oacute;n requerida por <strong>EL OUTSOURCER</strong>, sobre las operaciones comerciales de <strong>LA EMPRESA</strong> para los fines contables o, para la absoluci&oacute;n de consultas y resoluci&oacute;n de casos y tr&aacute;mites especiales que requieran, quedando bajo responsabilidad de la empresa las sanciones tributarias que puedan generarse por el incumplimiento de esta obligaci&oacute;n.</span></p>\r\n<p style="padding-left: 40px; text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">8.4. <strong>EL OUTSOURCER </strong>se obliga a mantener la confidencialidad de los temas y documentos que se manejen en la prestaci&oacute;n del servicio a <strong>LA EMPRESA.</strong></span></p>\r\n<p style="padding-left: 40px; text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">8.5. <strong>LAS PARTES</strong> se obligan a cumplir con las dem&aacute;s obligaciones que resulten de este contrato o de la Ley.</span></p>\r\n<p><span style="font-family: arial, helvetica, sans-serif;"><strong>&nbsp;</strong></span></p>\r\n<p><span style="font-family: arial, helvetica, sans-serif;"><strong>NOVENO. REQUERIMIENTOS DE SERVICIOS:</strong></span></p>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">Los requerimientos en asesor&iacute;a que haga <strong>LA EMPRESA</strong> a <strong>EL OUTSOURCER, </strong>dentro de los alcances de este contrato, podr&aacute;n efectuarse de cualquiera de las formas siguientes:</span></p>\r\n<p style="text-align: justify; padding-left: 40px;"><span style="font-family: arial, helvetica, sans-serif;">9.1. Mediante documento escrito, debidamente firmado por el representante de <strong>LA EMPRESA</strong> o por el personal autorizado para ello.</span></p>\r\n<p style="text-align: justify; padding-left: 40px;"><span style="font-family: arial, helvetica, sans-serif;">9.2. Mediante consulta directa por el representante de <strong>LA EMPRESA</strong></span></p>\r\n<p style="padding-left: 40px; text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">9.3. Mediante comunicaci&oacute;n remitida por fax u otro medio electr&oacute;nico, por el representante de <strong>LA EMPRESA</strong> o, por persona autorizada para ello. La absoluci&oacute;n de cada consulta a cargo de <strong>EL OUTSOURCER </strong>se realizar&aacute; por escrito o en forma verbal, ser&aacute; remitida a <strong>LA EMPRESA </strong>v&iacute;a fax, cualquier otro medio Electr&oacute;nico, entrega directa al domicilio de <strong>LA EMPRESA</strong> o puesta a disposici&oacute;n de ella, en las oficinas de <strong>EL OUTSOURCER</strong>, seg&uacute;n la naturaleza del caso y las circunstancias.</span></p>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;"><strong>EL OUTSOURCER</strong> se reserva la obligaci&oacute;n de absolver la consulta efectuada por <strong>EL EMPRESA</strong>, en el tiempo que considere necesario, el que en ning&uacute;n momento podr&aacute; exceder de 05 d&iacute;as h&aacute;biles, evaluando para ello la importancia y sugerencia de la misma.</span></p>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">En caso la consulta corresponda a un periodo no comprendido en la gesti&oacute;n de <strong>EL OUTSOURCER</strong>, o su materia no este contemplada en el contrato, &eacute;ste se encuentra facultado a considerarlo como un servicio adicional y por ende materia de cotizaci&oacute;n, que para su atenci&oacute;n requerir&aacute; autorizaci&oacute;n previa de <strong>LA EMPRESA</strong>.</span></p>\r\n<p><span style="font-family: arial, helvetica, sans-serif;"><strong>&nbsp;</strong></span></p>\r\n<p><span style="font-family: arial, helvetica, sans-serif;"><strong>DECIMO. RESOLUCION DEL CONTRATO</strong></span></p>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">Queda expresamente pactado que el presente contrato podr&aacute; resolverse antes del t&eacute;rmino del plazo se&ntilde;alado en la Cl&aacute;usula Cuarta, por cualquiera de las siguientes causales:</span></p>\r\n<p style="padding-left: 40px; text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">10.1. Por mutuo acuerdo entre las partes.</span></p>\r\n<p style="padding-left: 40px; text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">10.2. Por decisi&oacute;n unilateral de <strong>LA EMPRESA</strong>, sin expresi&oacute;n de causa alguna, la que surtir&aacute; efectos a partir de los 45 (cuarenta y cinco) d&iacute;as de recepcionada la comunicaci&oacute;n de tal decisi&oacute;n remitida a <strong>EL OUTSOURCER</strong> por <strong>LA EMPRESA</strong>. En este supuesto, <strong>LA EMPRESA</strong> estar&aacute; obligada a reconocer a <strong>EL OUTSOURCER</strong> el &iacute;ntegro de la retribuci&oacute;n devengada hasta el momento en que se haga efectiva la resoluci&oacute;n del contrato, as&iacute; como una penalidad equivalente al 25% de la retribuci&oacute;n dejada de facturar por la resoluci&oacute;n anticipada, la cual tendr&aacute; por finalidad cubrir los da&ntilde;os y perjuicios que la decisi&oacute;n de resoluci&oacute;n genera en <strong>EL OUTSOURCER.</strong></span></p>\r\n<p style="padding-left: 40px; text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">10.3. Por decisi&oacute;n de <strong>EL OUTSOURCER</strong> consecuencia del incumplimiento de pago por parte de <strong>LA EMPRESA</strong>, entendi&eacute;ndose como tal, el retraso de manera consecutiva o alternada de m&aacute;s de 02 (dos) comprobantes de pago de la retribuci&oacute;n devengada y no cancelada dentro del plazo establecido en la cl&aacute;usula quinta del presente contrato.</span></p>\r\n<p style="padding-left: 40px; text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">10.4. Por decisi&oacute;n de <strong>LA EMPRESA</strong> consecuencia del incumplimiento de las obligaciones de <strong>EL OUTSOURCER </strong>previstas en el contrato o en sus Anexos, en cuyo caso, <strong>LA EMPRESA</strong> deber&aacute; conminar mediante carta notarial a <strong>EL OUTSOURCER </strong>para que subsane las deficiencias del servicio, otorg&aacute;ndole un plazo no menor de 15 (quince) d&iacute;as h&aacute;biles computados desde la recepci&oacute;n de la carta notarial, conforme a lo establecido en el art&iacute;culo N&deg; 1429 del C&oacute;digo Civil.</span></p>\r\n<p>&nbsp;</p>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">Sin perjuicio de lo establecido en los numerales precedentes, los siguientes hechos ser&aacute;n considerados un incumplimiento de <strong>LA EMPRESA</strong>, y por tal motivo se le confiere la facultad a<strong> EL OUTSOURCER </strong>para resolver el presente contrato, siguiendo lo previsto en el art&iacute;culo 1430&ordm; del C&oacute;digo Civil:</span></p>\r\n<ol style="list-style-type: lower-alpha;">\r\n<li style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">Si <strong>LA EMPRESA</strong> se declara o es declarado en quiebra o cualquier otra forma de insolvencia o sometida a cualquier clase de procedimiento concursal.</span></li>\r\n<li style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">Si <strong>LA EMPRESA</strong> contrata bajo cualquier modalidad (laboral o civil) a personal que originalmente fuera designado por <strong>EL OUTSOURCER</strong> para realizar las labores materia del presente contrato.</span></li>\r\n<li style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">Si <strong>LA EMPRESA</strong> no cumple con las obligaciones previstas en este contrato.</span></li>\r\n<li style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">Si <strong>EL OUTSOURCER</strong> determina la irregularidad de alguna de las declaraciones efectuadas por <strong>LA EMPRESA</strong>, en el presente contrato o como consecuencia de la prestaci&oacute;n del servicio se determina la existencia de informaci&oacute;n falsa o adulterada que es proporcionada a <strong>EL OUTSOURCER</strong> para la realizaci&oacute;n de sus labores objeto del presente contrato.</span></li>\r\n</ol>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">Las partes acuerdan que los numerales c) y d) precedentes dan derecho a <strong>EL OUTSOURCER</strong> a establecer una penalidad equivalente al 25% de la retribuci&oacute;n dejada de facturar por resoluci&oacute;n anticipada, con la finalidad de cubrir los da&ntilde;os y perjuicios que la resoluci&oacute;n genera en <strong>EL OUTSOURCER. </strong></span></p>\r\n<p>&nbsp;</p>\r\n<p><span style="font-family: arial, helvetica, sans-serif;"><strong>UND&Eacute;CIMO. SOLUCI&Oacute;N DE CONTROVERSIAS</strong></span></p>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">Las partes acuerdan de forma expresa que cualquier controversia o diferencia con relaci&oacute;n a la existencia, validez, cumplimiento o ejecuci&oacute;n del presente contrato ser&aacute; resuelta por un &aacute;rbitro &uacute;nico nombrado por la C&aacute;mara Peruana de Arbitraje Mercantil, instituci&oacute;n a la cual las partes confieren el encargo de designaci&oacute;n conforme al inciso 3&ordm; del art&iacute;culo 22&ordm; del Decreto Legislativo N&ordm; 1071. Para tal prop&oacute;sito, las partes acuerdan y aceptan que el citado &aacute;rbitro sustanciara el proceso como un arbitraje de derecho y conforme a las reglas que considere m&aacute;s apropiadas de acuerdo a las circunstancias del caso y teniendo en cuenta el Decreto Legislativo N&ordm; 1071. Y por ende los intervinientes se&ntilde;alan como sus domicilios los consignados en la introducci&oacute;n del presente documento, a donde se les tendr&aacute; por notificados en forma v&aacute;lida.</span></p>\r\n<p>&nbsp;</p>\r\n<p><span style="font-family: arial, helvetica, sans-serif;"><strong>DUOD&Eacute;CIMO. INTERPRETACI&Oacute;N Y BUENA FE</strong></span></p>\r\n<p style="padding-left: 40px; text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">12.1. Los t&iacute;tulos de las cl&aacute;usulas del presente documento no podr&aacute;n limitar ni condicionar de manera alguna el contenido de las mismas, por lo que no tendr&aacute;n efecto alguno para la interpretaci&oacute;n del presente documento.</span></p>\r\n<p style="padding-left: 40px; text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">12.2. Las partes deber&aacute;n ejecutar el presente documento en base al principio de la buena fe y a los acuerdos que hayan llegado sobre los alcances de las obligaciones asumidas, por lo que acordar&aacute;n las adecuaciones del caso.</span></p>\r\n<p>&nbsp;</p>\r\n<p><span style="font-family: arial, helvetica, sans-serif;"><strong>DECIMOTERCERO. INDEMNIDAD</strong></span></p>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;"><strong>EL OUTSOURCER</strong> como <strong>LA EMPRESA</strong>, se obligan a mantener indemne y defender, e inclusive en cualquier caso a indemnizar a su contraparte, por los da&ntilde;os y perjuicios directos o indirectos que pudieran causarse como resultado de:</span></p>\r\n<ol style="list-style-type: lower-roman;">\r\n<li><span style="font-family: arial, helvetica, sans-serif;">El incumplimiento de cualquier estipulaci&oacute;n del contrato y/o de las normas t&eacute;cnicas o de seguridad que resulten aplicables.</span></li>\r\n<li><span style="font-family: arial, helvetica, sans-serif;">La violaci&oacute;n por parte del personal de <strong>EL OUTSOURCER</strong> o de <strong>LA EMPRESA</strong> de cualquier estipulaci&oacute;n del presente contrato o de las normas aplicables al mismo que pudiesen afectar el prestigio de las partes involucradas o de su personal.</span></li>\r\n<li><span style="font-family: arial, helvetica, sans-serif;">Cualquier demanda o reclamaci&oacute;n de terceros basados en los actos u omisiones de <strong>EL OUTSOURCER</strong> o de <strong>LA EMPRESA</strong>, en la ejecuci&oacute;n del presente contrato.</span></li>\r\n</ol>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">En caso que <strong>EL OUTSOURCER</strong> asuma la reparaci&oacute;n de alg&uacute;n da&ntilde;o personal o a la propiedad de terceros distintos a <strong>LA EMPRESA</strong>, por causas imputables a <strong>LA EMPRESA</strong>, <strong>EL OUTSOURCER</strong> incrementar&aacute; el monto equivalente a la reparaci&oacute;n, a la factura que se encuentre pendiente de pago.</span></p>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;"><strong>EL OUTSOURCER</strong> asumir&aacute; la responsabilidad de todo da&ntilde;o que pueda ocasionar en contra de <strong>LA EMPRESA</strong> o de terceros, y que le se ha atribuible o imputable por el incumplimiento parcial, tard&iacute;o o defectuoso de las obligaciones que le corresponden, o por incurrir en negligencia, impericia o imprudencia; y tambi&eacute;n por inobservancia de las disposiciones de seguridad u otras que se le impartan.</span></p>\r\n<p>&nbsp;</p>\r\n<p><span style="font-family: arial, helvetica, sans-serif;"><strong>DECIMOCUARTO. PROHIBICION DE CESI&Oacute;N</strong></span></p>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;"><strong>EL OUTSOURCER</strong> no podr&aacute; ceder su posici&oacute;n contractual, sus derechos u obligaciones bajo el presente Contrato, ni emplear a subcontratista alguno en la ejecuci&oacute;n del mismo, sin contar con la aprobaci&oacute;n previa por escrito de <strong>LA EMPRESA</strong>.</span></p>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">No obstante, lo anterior, ninguna aprobaci&oacute;n escrita de esta naturaleza deber&aacute; interpretarse, de manera alguna, como la descarga o liberaci&oacute;n de <strong>EL OUTSOURCER</strong> en lo que respecta a la prestaci&oacute;n del Servicio y al cumplimiento de cualesquiera de las obligaciones que se estipulan en este Contrato. <strong>EL OUTSOURCER</strong> continuar&aacute; siendo responsable solidario de cualquier cesionario de sus derechos u obligaciones.</span></p>\r\n<p>&nbsp;</p>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;"><strong>DECIMOQUINTO. PROPIEDAD DE LA INFORMACI&Oacute;N Y PRODUCTOS DEL TRABAJO</strong></span></p>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">Toda la informaci&oacute;n, documentos, reportes que sean entregados a <strong>EL OUTSOURCER </strong>como parte de la ejecuci&oacute;n del Servicio, pertenecer&aacute;n a <strong>LA EMPRESA</strong>; lo que le otorgar&aacute; el derecho de uso, modificaci&oacute;n, disposici&oacute;n, entre otros.</span></p>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">Toda la informaci&oacute;n, documentos, reportes y cualquier otro material proporcionado por <strong>LA EMPRESA</strong> durante la ejecuci&oacute;n del Servicio ser&aacute;n de propiedad exclusiva de <strong>LA EMPRESA</strong>. Por lo que <strong>EL OUTSOURCER</strong>, se compromete a no retener en su posesi&oacute;n, al t&eacute;rmino del Contrato, ninguno de los materiales descritos anteriormente o cualquier reproducci&oacute;n de tales materiales a menos que tenga la autorizaci&oacute;n por escrito de <strong>LA EMPRESA</strong> o en el caso que <strong>LA EMPRESA</strong> no haya cumplido con el pago integral de la retribuci&oacute;n pactada.<strong> </strong></span></p>\r\n<p>&nbsp;</p>\r\n<p><span style="font-family: arial, helvetica, sans-serif;"><strong>DECIMOSEXTO. PROTECCION DE DATOS PERSONALES </strong></span></p>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;"><strong>EL OUTSOURCER</strong> reconoce expresamente que los datos a los que tenga acceso en m&eacute;rito de este contrato son de exclusiva propiedad de <strong>LA EMPRESA</strong>, por lo que no podr&aacute; aplicarlos o utilizarlos con fines distintos a los previstos en el contrato de prestaci&oacute;n de servicios.</span></p>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;"><strong>EL OUTSOURCER </strong>&uacute;nicamente podr&aacute; tener acceso a aquellos datos que <strong>LA EMPRESA</strong> le proporcione en cumplimiento del presente contrato, y proceder&aacute; a su tratamiento de acuerdo con las instrucciones proporcionadas, no constituyendo, en ning&uacute;n caso, dicho acceso una comunicaci&oacute;n de datos, ni siquiera a efectos de su conservaci&oacute;n.</span></p>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;"><strong>EL OUTSOURCER</strong> se compromete a tratar los datos con la finalidad exclusiva de la realizaci&oacute;n del servicio, quedando obligado al cumplimiento de la Ley 29733, Ley de Protecci&oacute;n de Datos Personales y de su Reglamento.</span></p>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">Una vez culminado el presente contrato, <strong>EL OUTSOURCER</strong> se compromete a destruir los datos proporcionados por <strong>LA EMPRESA</strong>, as&iacute; como el resultado de cualquier elaboraci&oacute;n de los mismos y los soportes o documentos en que se halle recogida la informaci&oacute;n o, en su caso, a devolv&eacute;rselos a <strong>LA EMPRESA </strong>en funci&oacute;n de la decisi&oacute;n tomada por la misma en cada caso.&nbsp;</span></p>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">En caso de ser necesario que <strong>EL OUTSOURCER</strong> conserve los datos o una parte de los mismos a efectos de la atenci&oacute;n de posibles responsabilidades que pudiesen derivarse del tratamiento, estos deber&aacute;n permanecer convenientemente bloqueados hasta que transcurran los plazos de prescripci&oacute;n correspondientes, momento en que deber&aacute;n ser destruidos. <strong>LA EMPRESA</strong> deber&aacute; tener conocimiento de ellos, as&iacute; como de las medidas que garanticen el adecuado bloqueo de los datos y finalmente su destrucci&oacute;n.</span></p>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;"><strong>EL OUTSOURCER</strong> se compromete a comunicar y hacer cumplir a sus colaboradores asignados al servicio, las obligaciones establecidas en esta cl&aacute;usula. Cualquier uso de los datos que no se ajuste a lo dispuesto en la presente cl&aacute;usula, ser&aacute; responsabilidad exclusiva de <strong>EL OUTSOURCER</strong> frente a terceros y frente a <strong>LA EMPRESA</strong> ante la que responder&aacute; por los da&ntilde;os y perjuicios que le hubiere podido causar.</span></p>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;"><strong>El OUTSOURCER</strong> responder&aacute;, por tanto, de las infracciones en que pudiera incurrir en el caso de que destine los datos personales a otra finalidad, los comunique a un tercero, o en general, los utilice de forma irregular, as&iacute; como cuando no adopte las medidas correspondientes para el almacenamiento y custodia de los mismos.</span></p>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;"><strong>EL OUTSOURCER</strong> deber&aacute; adoptar las medidas de &iacute;ndole t&eacute;cnica y organizativas necesarias que garanticen la seguridad de los datos de car&aacute;cter personal y eviten su alteraci&oacute;n, p&eacute;rdida, tratamiento o acceso no autorizado, habida cuenta del estado de la tecnolog&iacute;a, la naturaleza de los datos almacenados y los riesgos a que est&aacute;n expuestos, ya provengan de la acci&oacute;n humana o del medio f&iacute;sico o natural. A estos efectos <strong>EL OUTSOURCER</strong> deber&aacute; aplicar los niveles de seguridad que se establecen en la Ley 29733, de acuerdo a la naturaleza de los datos que trate.</span></p>\r\n<p><span style="font-family: arial, helvetica, sans-serif;"><strong>&nbsp;</strong></span></p>\r\n<p><span style="font-family: arial, helvetica, sans-serif;"><strong>DECIMOS&Eacute;PTIMO. CONFIDENCIALIDAD </strong></span></p>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">Ambas partes se comprometen a utilizar para ning&uacute;n prop&oacute;sito distinto a la ejecuci&oacute;n del presente Contrato, ni divulgar, producir, publicar o permitir el acceso a la informaci&oacute;n confidencial que obtenga durante la o con motivo de la ejecuci&oacute;n del Contrato, sin contar con la autorizaci&oacute;n previa y por escrito de la otra parte.</span></p>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">La informaci&oacute;n confidencial comprende, sin limitaci&oacute;n, toda la informaci&oacute;n o materiales que se elaboren en relaci&oacute;n con el servicio, dise&ntilde;os, memorias descriptivas, modelos, informaci&oacute;n, documentaci&oacute;n, c&oacute;digos fuente, c&oacute;digos de objeto, diagramas, diagramas de flujo, investigaciones, desarrollos, procesos, procedimientos, conocimientos, manufactura, nombres de clientes, proveedores o del personal y cualquier informaci&oacute;n adicional que guarde relaci&oacute;n con los clientes, proveedores o personal, pol&iacute;ticas de precios e informaci&oacute;n financiera y dem&aacute;s informaci&oacute;n de naturaleza similar, se encuentre o no reducida a textos escritos o a otra forma tangible, y cualquier otro secreto comercial.</span></p>\r\n<p><span style="font-family: arial, helvetica, sans-serif;">La informaci&oacute;n confidencial no comprende:</span></p>\r\n<ol style="list-style-type: lower-roman;">\r\n<li style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">la informaci&oacute;n que conozca <strong>EL OUTSOURCER</strong> de manera leg&iacute;tima con anterioridad a la obtenci&oacute;n de la misma por medio de <strong>LA EMPRESA</strong>,</span></li>\r\n<li><span style="font-family: arial, helvetica, sans-serif;">la informaci&oacute;n de dominio p&uacute;blico, o,</span></li>\r\n<li style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">la informaci&oacute;n que obtenga <strong>EL OUTSOURCER</strong> de una tercera persona de manera leg&iacute;tima que no haya recibido acceso a la misma directa o indirectamente de <strong>LA EMPRESA</strong>. <strong>EL OUTSOURCER</strong> emplear&aacute; el m&aacute;s alto est&aacute;ndar de atenci&oacute;n que utilice con objeto de conservar su propia informaci&oacute;n confidencial a fin de evitar la utilizaci&oacute;n no autorizada o la divulgaci&oacute;n de dicha informaci&oacute;n confidencial.</span></li>\r\n</ol>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">La obligaci&oacute;n de confidencialidad se mantendr&aacute; vigente durante la ejecuci&oacute;n del presente Contrato y hasta por un per&iacute;odo de dos (02) a&ntilde;os adicionales desde su terminaci&oacute;n.</span></p>\r\n<p>&nbsp;</p>\r\n<p><span style="font-family: arial, helvetica, sans-serif;"><strong>DECIMOCTAVO. DESHONESTIDAD - PROHIBICION DE CONTRATAR</strong></span></p>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;"><strong>LA EMPRESA</strong> se compromete expresamente a no contratar directa ni indirectamente a ninguna persona que de manera directa haya prestado servicios personales y/o profesionales a <strong>EL OUTSOURCER </strong>o sus empresas relacionadas. La presente restricci&oacute;n tendr&aacute; una vigencia de un (01) a&ntilde;o computados desde:</span></p>\r\n<ol>\r\n<li style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">La resoluci&oacute;n o t&eacute;rmino de relaciones contractuales entre <strong>LA EMPRESA</strong> y <strong>EL OUTSOURCER</strong></span></li>\r\n</ol>\r\n<ol start="2">\r\n<li style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">El fin de la relaci&oacute;n laboral entre <strong>EL OUTSOURCER</strong> y su personal, a&uacute;n en el supuesto que <strong>LA EMPRESA </strong>y<strong> EL OUTSOURCER </strong>hayan culminado su relaci&oacute;n comercial.</span></li>\r\n</ol>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">Queda expresamente pactado que las restricciones se&ntilde;aladas en los numerales 1 y 2 precedentes, no son excluyentes entre s&iacute; sino complementarias, por lo que est&aacute;s deber&aacute;n ser interpretadas desde una perspectiva de protecci&oacute;n a la inversi&oacute;n en capacitaci&oacute;n del personal por parte de <strong>EL OUTSOURCER</strong>.</span></p>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;"><strong>LA EMPRESA</strong> declara que en caso de contravenir la presente obligaci&oacute;n reconocer&aacute; a favor de <strong>EL OUTSOURCER</strong> un importe equivalente a un (01) a&ntilde;o de la contraprestaci&oacute;n econ&oacute;mica pactada en el contrato.</span></p>\r\n<p><span style="font-family: arial, helvetica, sans-serif;"><strong>&nbsp;</strong></span></p>\r\n<p><span style="font-family: arial, helvetica, sans-serif;"><strong>DECIMONOVENO. DISPOSICIONES COMPLEMENTARIAS</strong></span></p>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;"><strong>EL OUTSOURCER</strong> se obliga a ejecutar sus obligaciones de forma diligente, profesional y satisfactoria, para lo cual, proceder&aacute; con observar las disposiciones normativas pertinentes vigentes, y cumplir&aacute; los plazos perentorios respectivos.</span></p>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">Empero, en el supuesto de que <strong>EL OUTSOURCER</strong> incumpla con lo estipulado precedentemente, ser&aacute; responsable de las multas y sanciones administrativas y pecuniarias que se le impongan a <strong>LA EMPRESA</strong>; y por tal motivo, proceder&aacute; con el pago de las mismas.</span></p>\r\n<p>&nbsp;</p>\r\n<p><span style="font-family: arial, helvetica, sans-serif;"><strong>VIG&Eacute;SIMO. APLICACI&Oacute;N SUPLETORIA</strong></span></p>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">En todo lo no previsto por las partes en el presente contrato, ambas partes se someten a lo estipulado en el C&oacute;digo Civil, en relaci&oacute;n a la prestaci&oacute;n de servicios, as&iacute; como a cualquier otra norma del sistema jur&iacute;dico vigente.</span></p>\r\n<p>&nbsp;</p>\r\n<p><span style="font-family: arial, helvetica, sans-serif;"><strong>VIG&Eacute;SIMO PRIMERO. COMUNICACI&Oacute;N ENTRE LAS PARTES</strong></span></p>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">Las partes se&ntilde;alan como sus domicilios los que aparecen en la introducci&oacute;n del presente instrumento. Todo cambio de domicilio deber&aacute; ser comunicado por escrito para que surta efecto entre las partes a los 15 (quince) d&iacute;as de notificado.</span></p>\r\n<p><span style="font-family: arial, helvetica, sans-serif;">Las partes, conformes con lo establecido en el presente contrato lo suscriben en la ciudad de Lima, 28 de diciembre del 2021.</span></p>', '<p style="text-align: center;"><span style="font-family: arial, helvetica, sans-serif;"><strong>ANEXO 1</strong></span></p>\r\n<p style="text-align: center;"><span style="font-family: arial, helvetica, sans-serif;"><strong><u>SERVICIOS DE ASESORIA PROFESIONAL MATERIA DE CONTRATACION</u></strong></span></p>\r\n<p><span style="font-family: arial, helvetica, sans-serif;"><strong><u>PRIMERA: ACTIVIDADES DE ASESORIA</u></strong></span></p>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">Los servicios de asesor&iacute;a profesional que son materia del contrato de fecha ut supra se encuentran relacionados con las siguientes actividades:</span></p>\r\n<p style="padding-left: 40px;"><span style="font-family: arial, helvetica, sans-serif;"><strong>I. ALCANCE DE LA ASESORIA CONTABLE Y TRIBUTARIA </strong></span></p>\r\n<p style="padding-left: 80px;"><span style="font-family: arial, helvetica, sans-serif;"><strong><u>CONTABILIDAD GENERAL</u></strong></span></p>\r\n<ul>\r\n<li style="list-style-type: none;">\r\n<ul>\r\n<li style="list-style-type: none;">\r\n<ul>\r\n<li style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">Estructuraci&oacute;n de plan de cuentas y generaci&oacute;n de centro de costos.</span></li>\r\n<li style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">Configuraci&oacute;n del plan de cuentas con los cat&aacute;logos de productos, centro de costos, c&oacute;digos de proveedores, c&oacute;digos de trabajadores, entre otros.</span></li>\r\n<li style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">Implementaci&oacute;n de pol&iacute;ticas contables (cierres mensuales, corte documentario, entre otros).</span></li>\r\n<li style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">Validaci&oacute;n de Facturas por Pagar que se direccionan al Registro de Compras.</span></li>\r\n<li style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">Validaci&oacute;n de Facturas por Cobrar que se direccionan al Registro de Ventas.</span></li>\r\n<li style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">Revisi&oacute;n de las Conciliaciones Bancarias mensuales una vez culminadas y revisadas por el &aacute;rea de Tesorer&iacute;a del cliente.</span></li>\r\n<li style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">Revisi&oacute;n de los c&aacute;lculos de los importes de impuestos por pagar mensualmente elaborados por el &aacute;rea Administrativa o de Recursos Humanos del cliente, tales como Essalud, 5ta y 4ta Categor&iacute;a, ONP.</span></li>\r\n<li style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">Elaboraci&oacute;n de la Liquidaci&oacute;n mensual de impuestos PDT PLAME.</span></li>\r\n<li style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">Elaboraci&oacute;n y Presentaci&oacute;n de los Libros Electr&oacute;nicos (PLE).</span></li>\r\n<li style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">An&aacute;lisis de todas las partidas contables que se encuentran inmersos en la elaboraci&oacute;n de los EEFF, cabe mencionar que las partidas contables de los Inventarios y Consumo de los mismos es brindado por el cliente, siendo su responsabilidad la emisi&oacute;n de estas cifras.</span></li>\r\n<li style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">Provisi&oacute;n de la Depreciaci&oacute;n del Activo Fijo y Amortizaci&oacute;n de Intangibles entregados por el cliente en su oportunidad.</span></li>\r\n<li style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">Preparaci&oacute;n de los papeles de trabajo que sustentan el c&aacute;lculo de los tributos mensuales.</span></li>\r\n<li style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">Elaboraci&oacute;n de la Liquidaci&oacute;n mensual de impuestos PDT 617 Otras Retenciones de ser el caso.</span></li>\r\n<li style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">Elaboraci&oacute;n de la Liquidaci&oacute;n mensual de impuestos PDT 621 IGV- Renta.</span></li>\r\n<li style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">Elaboraci&oacute;n de la Liquidaci&oacute;n mensual de impuestos PDT 626 Agentes de Retenci&oacute;n, de ser el caso.</span></li>\r\n<li style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">Elaboraci&oacute;n de la Liquidaci&oacute;n mensual de impuestos PDT 633 Agentes de Percepci&oacute;n, de ser el caso.</span></li>\r\n<li style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">Formulaci&oacute;n de Estados Financieros e Informaci&oacute;n Gerencial con una periodicidad mensual.</span></li>\r\n<li style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">Exposici&oacute;n de los EEFF con una periodicidad mensual.</span></li>\r\n<li style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">Elaboraci&oacute;n de la Declaraci&oacute;n Jurada Anual del Impuesto a la Renta de 3&deg; Categor&iacute;a y Preparaci&oacute;n de las hojas de trabajo respectivas.</span></li>\r\n<li style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">Preparaci&oacute;n y presentaci&oacute;n de las Declaraciones Informativas a que este obligado el cliente, tales como la declaraci&oacute;n Anual de Operaciones con terceros (DAOT).</span></li>\r\n<li style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">Preparaci&oacute;n y presentaci&oacute;n de las Declaraciones Determinativas a que este obligado el cliente, tales como la del Impuesto Temporal a los Activos Netos (ITAN).</span></li>\r\n<li style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">Atenci&oacute;n de consultas a los requerimientos de informaci&oacute;n y sustento derivado de los procesos de auditoria que mantiene la empresa con servicios de terceros, hasta por un tope de 05 horas al mes.</span></li>\r\n<li style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">Atenci&oacute;n de consultas a los requerimientos de informaci&oacute;n y sustento derivado de los procesos de fiscalizaci&oacute;n parcial iniciados por SUNAT y requerimiento de informaci&oacute;n por SUNAFIL correspondiente a operativos de fiscalizaci&oacute;n.</span></li>\r\n<li style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">Atenci&oacute;n de consultas tributarias y laborales hasta por un tope de 05 al mes, estas no son acumulables para los meses siguientes.</span></li>\r\n</ul>\r\n</li>\r\n</ul>\r\n</li>\r\n</ul>\r\n<p><span style="font-family: arial, helvetica, sans-serif;"><strong>&nbsp;</strong></span></p>\r\n<p style="padding-left: 80px;"><span style="text-decoration: underline;"><span style="font-family: arial, helvetica, sans-serif;"><strong>N&Oacute;MINAS</strong></span></span></p>\r\n<ul>\r\n<li style="list-style-type: none;">\r\n<ul>\r\n<li style="list-style-type: none;">\r\n<ul>\r\n<li><span style="font-family: arial, helvetica, sans-serif;">C&aacute;lculo de n&oacute;minas</span></li>\r\n<li><span style="font-family: arial, helvetica, sans-serif;">C&aacute;lculo de Decreto. Ley &ndash; seg&uacute;n condici&oacute;n de cada colaborador</span></li>\r\n<li><span style="font-family: arial, helvetica, sans-serif;">C&aacute;lculo de Retenciones (5ta, ONP, AFP)</span></li>\r\n<li><span style="font-family: arial, helvetica, sans-serif;">C&aacute;lculo de vacaciones en cada oportunidad.</span></li>\r\n<li><span style="font-family: arial, helvetica, sans-serif;">C&aacute;lculo semestral de CTS y Gratificaciones.</span></li>\r\n<li><span style="font-family: arial, helvetica, sans-serif;">C&aacute;lculo de Participaci&oacute;n de Utilidades de Ley.</span></li>\r\n<li><span style="font-family: arial, helvetica, sans-serif;">C&aacute;lculo de las Liquidaciones de Beneficios Sociales.</span></li>\r\n<li><span style="font-family: arial, helvetica, sans-serif;">Preparaci&oacute;n Liquidaci&oacute;n mensual de AFP v&iacute;a AFP NET</span></li>\r\n<li><span style="font-family: arial, helvetica, sans-serif;">Preparaci&oacute;n del PDT PLAME.</span></li>\r\n<li><span style="font-family: arial, helvetica, sans-serif;">C&aacute;lculo mensual de provisiones de CTS, Vacaciones y Gratificaciones.</span></li>\r\n</ul>\r\n</li>\r\n</ul>\r\n</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><span style="text-decoration: underline;"><span style="font-family: arial, helvetica, sans-serif;"><strong>SEGUNDA</strong><strong>: CONDICIONES FINALES DEL SERVICIO</strong>:</span></span></p>\r\n<p style="padding-left: 40px;"><span style="font-family: arial, helvetica, sans-serif;">2.1. El cliente deber&aacute; proporcionar lo siguiente:</span></p>\r\n<ul>\r\n<li style="list-style-type: none;">\r\n<ul>\r\n<li style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">Facilidades para acceder <strong>digitalmente a la documentaci&oacute;n</strong>, contratos, correspondencia o cualquier otro documento que permita el debido Registro Contable.</span></li>\r\n</ul>\r\n</li>\r\n</ul>\r\n<p style="padding-left: 40px; text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">2.2. El cliente deber&aacute; almacenar la informaci&oacute;n digital de manera correlativa en el drive que ser&aacute; asignado bajo los procedimientos indicados.</span></p>\r\n<p style="padding-left: 40px; text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">2.3. De no tener Libros Electr&oacute;nicos, el empaste y la impresi&oacute;n de libros contables ser&aacute;n cubiertos por el cliente.</span></p>\r\n<p style="padding-left: 40px; text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">2.4. El supervisor contable asistir&aacute; a sus instalaciones cuando sea estrictamente requerido por la gerencia por temas de atenci&oacute;n parcial SUNAT, Laborales, entre otros, previa coordinaci&oacute;n.</span></p>\r\n<p style="padding-left: 40px; text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">2.5. El &aacute;rea de RRHH del cliente deber&aacute; hacer entrega de la informaci&oacute;n necesaria de n&oacute;minas al &aacute;rea contable para poder realizar el c&aacute;lculo de impuesto en las fechas establecidas del corte documentario, siendo responsabilidad del cliente la ejecuci&oacute;n del pago correspondiente.</span></p>\r\n<p style="padding-left: 40px; text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">2.6. Nuestro personal encargado de la elaboraci&oacute;n de n&oacute;minas, deber&aacute; recibir el tareo con las incidencias del mes de manera oportuna, seg&uacute;n las fechas de corte establecidas para el proceso.</span></p>\r\n<p style="padding-left: 40px; text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">2.7. Para poder cumplir con el respectivo c&aacute;lculo de n&oacute;minas nuestro analista solicitar&aacute; al &aacute;rea administrativa o Recursos Humanos, las incidencias de las asistencias del personal (tareo), bajo el formato establecido por nuestra empresa.</span></p>\r\n<p style="padding-left: 40px; text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">2.8. Nuestro servicio de n&oacute;minas no involucra manejo f&iacute;sico de documentos. Para otros tr&aacute;mites que impliquen manejo administrativo de documentos relacionados se considerar&aacute;n tarifas espec&iacute;ficas previamente acordadas con su empresa.</span></p>\r\n<p style="padding-left: 40px; text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">2.9. El servicio de n&oacute;minas, involucra el proceso de c&aacute;lculo de planillas, as&iacute; como el llenado de PLAME y declaraci&oacute;n de obligaciones laborales como AFP, siendo responsabilidad del cliente la ejecuci&oacute;n del pago correspondiente.</span></p>\r\n<p style="padding-left: 40px; text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">2.10. El proceso del servicio y de la supervisi&oacute;n contable se realizar&aacute; <strong>On Line</strong>, y presencial de ser necesario, en cuyo caso el cliente asumir&aacute; los gastos relacionados a los vi&aacute;ticos (movilidad I/D, refrigerio).</span></p>\r\n<p style="padding-left: 40px; text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">2.11. No incluye la Elaboraci&oacute;n de los Kardex ni en Unidades ni Valorizado.</span></p>\r\n<p style="padding-left: 40px; text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">2.12. No incluye la Elaboraci&oacute;n del Flujo de Caja ni Presupuesto.</span></p>\r\n<p style="padding-left: 40px; text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">2.13. No incluye la toma de los inventarios f&iacute;sicos ni de activos ni de mercader&iacute;as.</span></p>\r\n<p style="padding-left: 40px; text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">2.14. Los servicios de planeamiento, estrategia y atenci&oacute;n ante cualquier fiscalizaci&oacute;n de alguna entidad supervisora (SUNAT, SUNAFIL. INEI, etc.), ser&aacute;n cotizadas en funci&oacute;n de las horas que demande dicha gesti&oacute;n (abogados, contadores especializados en temas tributarios y laborales y personal operativo necesario para recabar documentaci&oacute;n e informaci&oacute;n requerida).</span></p>\r\n<p style="padding-left: 40px; text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">2.15. No incluye la asesor&iacute;a para la adopci&oacute;n de las IFRS &ldquo;Normas Internacionales de Informaci&oacute;n Financiera&rdquo;. Asimismo, la validaci&oacute;n de la Declaraci&oacute;n Anual a la Superintendencia de Mercado de Valores &ldquo;SMV&rdquo;.</span></p>\r\n<p style="padding-left: 40px; text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">2.16. No incluye el patrocinio de LA EMPRESA en procedimientos administrativos (fiscalizaciones y procedimientos contenciosos tributarios y/o laborales) y/o judiciales; la realizaci&oacute;n de planificaciones laborales, auditor&iacute;as y todos aquellos encargos que razonablemente no integran una consultor&iacute;a ordinaria.</span></p>\r\n<p style="padding-left: 40px; text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">2.17. La firma del contrato en se&ntilde;al de conformidad por ambas partes, es requisito imprescindible para el inicio de nuestro servicio.</span></p>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">Queda estipulado que <strong>EL OUTSOURCER</strong> podr&aacute; prestar servicios adicionales, previo acuerdo de las partes respecto al pago de los honorarios por parte de <strong>LA EMPRESA</strong>.</span></p>\r\n<p>&nbsp;</p>\r\n<p><span style="font-family: arial, helvetica, sans-serif;"><strong><u>TERCERA</u></strong><strong>: CONDICIONES ESPECIALES DEL SERVICIO</strong></span></p>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">El sistema contable que se utilizar&aacute; es de propiedad de ACG y se ceder&aacute; en uso al cliente durante la etapa contractual, ante una eventual ruptura el sistema podr&iacute;a ser usado por el cliente durante tres (03) meses, computados desde la fecha de t&eacute;rmino del contrato sin costo alguno o en su defecto se podr&iacute;a alquilar seg&uacute;n las necesidades del cliente.</span></p>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">La localizaci&oacute;n del software deber&aacute; de contemplar toda la normativa tributaria que exige la ley peruana.</span></p>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">Las partes, conformes con lo establecido en el presente contrato lo suscriben en la ciudad de Lima, 28 de diciembre del 2021</span></p>\r\n<p>&nbsp;</p>\r\n<p><span style="font-family: arial, helvetica, sans-serif;"><strong>AQUAWORKS PERU SAC</strong><strong> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; GESTOR DE SOLUCIONES EMPRESARIALES SAC </strong></span></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><span style="font-family: arial, helvetica, sans-serif;">ANDREA LUC&Iacute;A BENAVIDES GIL &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</strong>LUIS FELIPE SARAVIA MUNAYCO&nbsp;</span></p>\r\n<p><span style="font-family: arial, helvetica, sans-serif;">GERENTE GENERAL&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;GERENTE GENERAL</span></p>\r\n<p><span style="font-family: arial, helvetica, sans-serif;">DNI. 45394164&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;DNI. 46995351</span></p>\r\n<p>&nbsp;</p>\r\n<p><span style="font-family: arial, helvetica, sans-serif;"><strong>&nbsp;</strong></span></p>\r\n<p><span style="font-family: arial, helvetica, sans-serif;"><strong>&nbsp;</strong></span></p>\r\n<p><span style="font-family: arial, helvetica, sans-serif;"><strong>&nbsp;</strong></span></p>\r\n<p><span style="font-family: arial, helvetica, sans-serif;"><strong>&nbsp;</strong></span></p>\r\n<p><span style="font-family: arial, helvetica, sans-serif;"><strong>&nbsp;</strong></span></p>\r\n<p><span style="font-family: arial, helvetica, sans-serif;"><strong>&nbsp;</strong></span></p>\r\n<p><span style="font-family: arial, helvetica, sans-serif;"><strong>&nbsp;</strong></span></p>\r\n<p><span style="font-family: arial, helvetica, sans-serif;"><strong>&nbsp;</strong></span></p>\r\n<p><span style="font-family: arial, helvetica, sans-serif;"><strong>&nbsp;</strong></span></p>\r\n<p><span style="font-family: arial, helvetica, sans-serif;"><strong>&nbsp;</strong></span></p>\r\n<p style="text-align: center;"><span style="font-family: arial, helvetica, sans-serif;"><strong>ANEXO 2</strong></span></p>\r\n<p style="text-align: center;"><span style="font-family: arial, helvetica, sans-serif;"><strong><u>RETRIBUCI&Oacute;N ECON&Oacute;MICA</u></strong></span></p>\r\n<p style="text-align: center;">&nbsp;</p>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">Las partes acuerdan que la retribuci&oacute;n por los servicios contratados ser&aacute;n los siguientes:</span></p>\r\n<p style="text-align: justify; padding-left: 40px;"><span style="font-family: arial, helvetica, sans-serif;">Por la Asesor&iacute;a Mensual Contable, Tributaria y N&oacute;minas, los honorarios de enero a junio ascienden a <strong>S/.XXXXXXXX</strong> <strong>m&aacute;s IGV</strong> en forma mensual, los cuales ser&aacute;n cancelados los 15 primeros d&iacute;as de cada mes (mes vigente).</span></p>\r\n<p style="text-align: justify; padding-left: 40px;"><span style="font-family: arial, helvetica, sans-serif;">Por la Asesor&iacute;a Mensual Contable, Tributaria y N&oacute;minas, los honorarios de julio a diciembre ascienden a <strong>S/.XXXXXXXX</strong> <strong>m&aacute;s IGV</strong> en forma mensual, los cuales ser&aacute;n cancelados los 15 primeros d&iacute;as de cada mes (mes vigente).</span></p>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">En el mes de marzo de cada a&ntilde;o, se realizar&aacute; el pago de un honorario adicional, cuyo importe es el equivalente al honorario del mes anterior m&aacute;s IGV, por la preparaci&oacute;n y formulaci&oacute;n de la Declaraci&oacute;n Jurada Anual del Impuesto a la Renta. &nbsp;</span></p>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">Los costos y gastos que se efect&uacute;en para el cumplimiento de cualquier prestaci&oacute;n adicional al servicio de Asesor&iacute;a Ordinaria, tales como gastos notariales, reg&iacute;strales, aranceles judiciales, tasas administrativas, empleos de personal auxiliar, fotocopias, vi&aacute;ticos y pasajes en Lima y fuera de &eacute;sta, y otros gastos afines, son asumidos por <strong>LA EMPRESA</strong>.</span></p>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">Las partes, conformes con lo establecido en el presente contrato lo suscriben en la ciudad de Lima, el 28 de diciembre del 2021</span></p>\r\n<p><span style="font-family: arial, helvetica, sans-serif;"><strong>&nbsp;</strong></span></p>\r\n<p><span style="font-family: arial, helvetica, sans-serif;"><strong>AQUAWORKS PERU SAC</strong><strong> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; GESTOR DE SOLUCIONES EMPRESARIALES SAC </strong></span></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><span style="font-family: arial, helvetica, sans-serif;">ANDREA LUC&Iacute;A BENAVIDES GIL &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</strong>Luis Felipe Saravia Munayco&nbsp;</span></p>\r\n<p><span style="font-family: arial, helvetica, sans-serif;">GERENTE GENERAL&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;GERENTE GENERAL</span></p>\r\n<p><span style="font-family: arial, helvetica, sans-serif;">DNI. N&ordm; 45394164&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; DNI. N&ordm; 46995351</span></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', NULL, 1, 2, '2022-03-29 16:06:57');
